    ja: "Loading...",
    kn: 'ಈ ಅಧ್ಯಯನಕ್ಕೆ ಅಜ್ಞಾತ/ಖಾಸಗಿ ವಿಂಡೋ ಅಗತ್ಯವಿದೆ ಮತ್ತು ಈ ವಿಂಡೋ ಅಲ್ಲ. ನೀವು ಇದನ್ನು ಸರಿಪಡಿಸಬಹುದು. Safari ಹೊರತುಪಡಿಸಿ ಯಾವುದೇ ಬ್ರೌಸರ್ ಅನ್ನು ಬಳಸಿ, ಅಜ್ಞಾತ ವಿಂಡೋವನ್ನು ತೆರೆಯಿರಿ ಮತ್ತು ಆ ವಿಂಡೋದಲ್ಲಿ ಅಧ್ಯಯನ ಲಿಂಕ್ ಅನ್ನು ರನ್ ಮಾಡಿ. \n \n ವಿವರಣೆ: ಎಲ್ಲಾ ಪ್ರಮುಖ ಬ್ರೌಸರ್‌ಗಳು ಅಜ್ಞಾತ ಮೋಡ್‌ನಲ್ಲಿ ವಿಂಡೋವನ್ನು ತೆರೆಯಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ, ಆದರೂ ಹೆಸರು ಬದಲಾಗಬಹುದು, ಉದಾ. "ಅಜ್ಞಾತ", "ಖಾಸಗಿ", "ಖಾಸಗಿ ಬ್ರೌಸಿಂಗ್", ಅಥವಾ "ಖಾಸಗಿ ವಿಂಡೋ". Safari ಹೊರತುಪಡಿಸಿ ಎಲ್ಲಾ ಬ್ರೌಸರ್‌ಗಳು ವೆಬ್ ಪುಟವು ಅಜ್ಞಾತ ಮೋಡ್‌ನಲ್ಲಿದೆಯೇ ಎಂದು ವರದಿ ಮಾಡುತ್ತದೆ. ಸಫಾರಿ ಯಾವಾಗಲೂ ಇಲ್ಲ ಎಂದು ಹೇಳುತ್ತದೆ. ಅಜ್ಞಾತ ಮೋಡ್ ಅನ್ನು ಸಾಮಾನ್ಯವಾಗಿ ಗೌಪ್ಯತೆಗಾಗಿ ಬಳಸಲಾಗುತ್ತದೆ. EasyEyes ಇದನ್ನು EasyEyes Firebase ಲೈಬ್ರರಿಗೆ ಸುಲಭವಾಗಿ ಪ್ರವೇಶಿಸಲು ಬಳಸುತ್ತದೆ, ಇದು ಧ್ವನಿ ಮಾಪನಾಂಕ ನಿರ್ಣಯಕ್ಕೆ ಅಗತ್ಯವಾಗಿರುತ್ತದೆ.',
    ko: '이 연구에는 시크릿/비공개 창이 필요한데, 이 창은 그렇지 않습니다. 이 문제를 해결할 수 있습니다. Safari 이외의 브라우저를 사용하여 시크릿 창을 열고 해당 창에서 연구 링크를 실행하세요.\n\n설명: 모든 주요 브라우저에서 시크릿 모드로 창을 열 수 있지만, 이름은 "시크릿", "InPrivate", "Private Browsing" 또는 "Private Window" 등 다양합니다. Safari를 제외한 모든 브라우저는 웹 페이지가 시크릿 모드인지 여부를 보고합니다. Safari는 항상 "아니요"라고 표시합니다. 시크릿 모드는 일반적으로 개인 정보 보호를 위해 사용됩니다. EasyEyes는 이 모드를 사용하여 사운드 보정에 필요한 EasyEyes Firebase 라이브러리에 쉽게 액세스할 수 있도록 합니다.',
    lt: "Loading...",
    ms: "Kajian ini memerlukan tetingkap inkognito/peribadi, dan tetingkap ini tidak. Anda boleh membetulkannya. Menggunakan mana-mana penyemak imbas selain Safari, buka tetingkap inkognito dan jalankan pautan kajian dalam tetingkap itu. \n \n PENJELASAN: Semua penyemak imbas utama membenarkan anda membuka tetingkap dalam mod inkognito, walaupun namanya berbeza-beza, mis. “Inkognito”, “InPrivate”, “Menyemak Imbas Peribadi” atau “Tetingkap Peribadi”. Semua penyemak imbas kecuali Safari melaporkan sama ada halaman web berada dalam mod inkognito. Safari selalu berkata tidak. Mod inkognito biasanya digunakan untuk privasi. EasyEyes menggunakannya untuk memudahkan akses kepada perpustakaan EasyEyes Firebase, yang diperlukan untuk penentukuran bunyi.",
    ml: 'ഈ പഠനത്തിന് ഒരു ആൾമാറാട്ട/സ്വകാര്യ വിൻഡോ ആവശ്യമാണ്, ഈ വിൻഡോ അങ്ങനെയല്ല. നിങ്ങൾക്ക് ഇത് പരിഹരിക്കാൻ കഴിയും. സഫാരി ഒഴികെയുള്ള ഏതെങ്കിലും ബ്രൗസർ ഉപയോഗിച്ച്, ഒരു ആൾമാറാട്ട വിൻഡോ തുറന്ന്, ആ വിൻഡോയിൽ പഠന ലിങ്ക് പ്രവർത്തിപ്പിക്കുക. \n \n വിശദീകരണം: എല്ലാ പ്രധാന ബ്രൗസറുകളും ആൾമാറാട്ട മോഡിൽ ഒരു വിൻഡോ തുറക്കാൻ നിങ്ങളെ അനുവദിക്കുന്നു, പേരിന് വ്യത്യാസമുണ്ടെങ്കിലും, ഉദാ. "ആൾമാറാട്ടം", "ഇൻപ്രൈവറ്റ്", "സ്വകാര്യ ബ്രൗസിംഗ്" അല്ലെങ്കിൽ "സ്വകാര്യ വിൻഡോ". Safari ഒഴികെയുള്ള എല്ലാ ബ്രൗസറുകളും വെബ് പേജ് ആൾമാറാട്ട മോഡിൽ ആണോ എന്ന് റിപ്പോർട്ട് ചെയ്യുന്നു. സഫാരി എപ്പോഴും ഇല്ല എന്ന് പറയും. ആൾമാറാട്ട മോഡ് സാധാരണയായി സ്വകാര്യതയ്ക്കായി ഉപയോഗിക്കുന്നു. ശബ്‌ദ കാലിബ്രേഷന് ആവശ്യമായ EasyEyes ഫയർബേസ് ലൈബ്രറിയിലേക്കുള്ള ആക്‌സസ് എളുപ്പമാക്കാൻ EasyEyes ഇത് ഉപയോഗിക്കുന്നു.',
    no: 'Denne studien trenger et inkognito/privat vindu, og dette vinduet er ikke det. Du kan fikse dette. Bruk en annen nettleser enn Safari, åpne et inkognitovindu og kjør studiekoblingen i det vinduet. \n \n FORKLARING: Alle store nettlesere lar deg åpne et vindu i inkognitomodus, selv om navnet varierer, f.eks. "Inkognito", "InPrivate", "Privat surfing" eller "Privat vindu". Alle nettlesere unntatt Safari rapporterer om nettsiden er i inkognitomodus. Safari sier alltid nei. Inkognitomodus brukes vanligvis for personvern. EasyEyes bruker det for å lette tilgangen til EasyEyes Firebase-biblioteket, som er nødvendig for lydkalibrering.',
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Для этого исследования требуется окно инкогнито/приватное окно, а это окно не является таковым. Вы можете это исправить. Используя любой браузер, кроме Safari, откройте окно инкогнито и запустите ссылку на исследование в этом окне. \n\nОБЪЯСНЕНИЕ: Все основные браузеры позволяют открывать окно в режиме инкогнито, хотя название может быть разным, например «Incognito», «InPrivate», «Private Browsing» или «Private Window». Все браузеры, кроме Safari, сообщают, находится ли веб-страница в режиме инкогнито. Safari всегда говорит «нет». Режим инкогнито обычно используется для обеспечения конфиденциальности. EasyEyes использует его для облегчения доступа к библиотеке EasyEyes Firebase, которая необходима для калибровки звука.",
