    id: 'Seperti yang dinyatakan dalam deskripsinya, studi ini memerlukan jendela penyamaran/pribadi, dan jendela ini tidak memerlukannya. Anda dapat memperbaikinya. Dengan menggunakan peramban apa pun selain Safari, buka jendela penyamaran, dan jalankan tautan studi di jendela tersebut. \n\nPENJELASAN: Semua peramban utama memungkinkan Anda untuk membuka jendela dalam mode penyamaran, meskipun namanya bervariasi, misalnya "Incognito", "InPrivate", "Private Browsing", atau "Private Window". Semua peramban kecuali Safari melaporkan apakah halaman web berada dalam mode penyamaran. Safari selalu mengatakan tidak. Mode penyamaran biasanya digunakan untuk privasi. EasyEyes menggunakannya untuk memudahkan akses ke pustaka EasyEyes Firebase, yang diperlukan untuk kalibrasi suara.',
    it: "Loading...",
    ja: "Loading...",
    kn: 'ಅದರ ವಿವರಣೆಯಲ್ಲಿ ಹೇಳಿರುವಂತೆ, ಈ ಅಧ್ಯಯನಕ್ಕೆ ಅಜ್ಞಾತ/ಖಾಸಗಿ ವಿಂಡೋ ಅಗತ್ಯವಿದೆ ಮತ್ತು ಈ ವಿಂಡೋ ಅಲ್ಲ. ನೀವು ಇದನ್ನು ಸರಿಪಡಿಸಬಹುದು. Safari ಹೊರತುಪಡಿಸಿ ಯಾವುದೇ ಬ್ರೌಸರ್ ಅನ್ನು ಬಳಸಿ, ಅಜ್ಞಾತ ವಿಂಡೋವನ್ನು ತೆರೆಯಿರಿ ಮತ್ತು ಆ ವಿಂಡೋದಲ್ಲಿ ಅಧ್ಯಯನ ಲಿಂಕ್ ಅನ್ನು ರನ್ ಮಾಡಿ. \n \nವಿವರಣೆ: ಎಲ್ಲಾ ಪ್ರಮುಖ ಬ್ರೌಸರ್‌ಗಳು ಅಜ್ಞಾತ ಮೋಡ್‌ನಲ್ಲಿ ವಿಂಡೋವನ್ನು ತೆರೆಯಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ, ಆದರೂ ಹೆಸರು ಬದಲಾಗಬಹುದು, ಉದಾ. "ಅಜ್ಞಾತ", "ಖಾಸಗಿ", "ಖಾಸಗಿ ಬ್ರೌಸಿಂಗ್", ಅಥವಾ "ಖಾಸಗಿ ವಿಂಡೋ". Safari ಹೊರತುಪಡಿಸಿ ಎಲ್ಲಾ ಬ್ರೌಸರ್‌ಗಳು ವೆಬ್ ಪುಟವು ಅಜ್ಞಾತ ಮೋಡ್‌ನಲ್ಲಿದೆಯೇ ಎಂದು ವರದಿ ಮಾಡುತ್ತದೆ. ಸಫಾರಿ ಯಾವಾಗಲೂ ಇಲ್ಲ ಎಂದು ಹೇಳುತ್ತದೆ. ಅಜ್ಞಾತ ಮೋಡ್ ಅನ್ನು ಸಾಮಾನ್ಯವಾಗಿ ಗೌಪ್ಯತೆಗಾಗಿ ಬಳಸಲಾಗುತ್ತದೆ. EasyEyes ಇದನ್ನು EasyEyes Firebase ಲೈಬ್ರರಿಗೆ ಸುಲಭವಾಗಿ ಪ್ರವೇಶಿಸಲು ಬಳಸುತ್ತದೆ, ಇದು ಧ್ವನಿ ಮಾಪನಾಂಕ ನಿರ್ಣಯಕ್ಕೆ ಅಗತ್ಯವಾಗಿರುತ್ತದೆ.',
    ko: '설명에 명시된 대로 이 연구에는 시크릿/비공개 창이 필요하지만, 이 창은 그렇지 않습니다. 이 문제를 해결할 수 있습니다. Safari 이외의 브라우저를 사용하여 시크릿 창을 열고 해당 창에서 연구 링크를 실행하세요.\n\n설명: 모든 주요 브라우저에서 시크릿 모드로 창을 열 수 있지만, 이름은 "시크릿", "InPrivate", "Private Browsing" 또는 "Private Window" 등 다양합니다. Safari를 제외한 모든 브라우저는 웹 페이지가 시크릿 모드인지 여부를 보고합니다. Safari는 항상 "아니요"라고 표시합니다. 시크릿 모드는 일반적으로 개인 정보 보호를 위해 사용됩니다. EasyEyes는 이 모드를 사용하여 사운드 보정에 필요한 EasyEyes Firebase 라이브러리에 쉽게 액세스할 수 있도록 합니다.',
    lt: "Loading...",
    ms: "Seperti yang dinyatakan dalam penerangannya, kajian ini memerlukan tetingkap inkognito/peribadi, dan tetingkap ini tidak. Anda boleh membetulkannya. Menggunakan mana-mana penyemak imbas selain Safari, buka tetingkap inkognito dan jalankan pautan kajian dalam tetingkap itu. \n \nPENJELASAN: Semua penyemak imbas utama membenarkan anda membuka tetingkap dalam mod inkognito, walaupun namanya berbeza-beza, mis. “Inkognito”, “InPrivate”, “Menyemak Imbas Peribadi” atau “Tetingkap Peribadi”. Semua penyemak imbas kecuali Safari melaporkan sama ada halaman web berada dalam mod inkognito. Safari selalu berkata tidak. Mod inkognito biasanya digunakan untuk privasi. EasyEyes menggunakannya untuk memudahkan akses kepada perpustakaan EasyEyes Firebase, yang diperlukan untuk penentukuran bunyi.",
