    tr: 'Açıklamasında belirtildiği gibi, bu çalışmanın gizli/özel bir pencereye ihtiyacı var ve bu pencere öyle değil. Bunu düzeltebilirsiniz. Safari dışındaki herhangi bir tarayıcıyı kullanarak gizli bir pencere açın ve çalışma bağlantısını o pencerede çalıştırın. \n\nAÇIKLAMA: Tüm büyük tarayıcılar gizli modda bir pencere açmanıza izin verir, ancak adları değişir, örn. "Gizli", "InPrivate", "Özel Tarama" veya "Özel Pencere". Safari dışındaki tüm tarayıcılar web sayfasının gizli modda olup olmadığını bildirir. Safari her zaman hayır der. Gizli mod genellikle gizlilik için kullanılır. EasyEyes bunu ses kalibrasyonu için gereken EasyEyes Firebase kitaplığına erişimi kolaylaştırmak için kullanır.',
    ur: 'جیسا کہ اس کی تفصیل میں بتایا گیا ہے، اس مطالعے کو ایک پوشیدگی/نجی ونڈو کی ضرورت ہے، اور یہ ونڈو نہیں ہے۔ آپ اسے ٹھیک کر سکتے ہیں۔ سفاری کے علاوہ کسی بھی براؤزر کا استعمال کرتے ہوئے، ایک پوشیدگی ونڈو کھولیں، اور اس ونڈو میں مطالعہ کا لنک چلائیں۔ \n \nوضاحت: تمام بڑے براؤزرز آپ کو پوشیدگی وضع میں ونڈو کھولنے کی اجازت دیتے ہیں، حالانکہ نام مختلف ہوتا ہے، جیسے "پوشیدگی"، "ان پرائیویٹ"، "پرائیویٹ براؤزنگ"، یا "پرائیویٹ ونڈو"۔ سفاری کے علاوہ تمام براؤزر رپورٹ کرتے ہیں کہ آیا ویب صفحہ پوشیدگی وضع میں ہے۔ سفاری ہمیشہ نہیں کہتا۔ پوشیدگی وضع عام طور پر رازداری کے لیے استعمال ہوتی ہے۔ EasyEyes اسے EasyEyes Firebase لائبریری تک رسائی کو آسان بنانے کے لیے استعمال کرتا ہے، جو آواز کیلیبریشن کے لیے درکار ہے۔',
