    hi: "Loading...",
    hu: "Loading...",
    is: 'Einstakt auðkenni er nauðsynlegt til að tengja gögn yfir lotur. Þessi tölva tók áður þátt í lotu um **ddd** með EasyEyes auðkenninu „**sss**“. Ýttu á OK ef það ert þú. Annars, ef þú ert með EasyEyes ID skrá, ýttu á skráavalshnappinn hér að neðan til að opna hana. (Skráarnafnið byrjar á „EasyEyes“, endar á „.txt“ og er venjulega í niðurhalsmöppunni þinni.) Ef þú ert ekki með skrá en veist um EasyEyes auðkennið þitt skaltu slá það inn. Annars skaltu bara búa til þitt eigið auðkenni, sem getur verið hvaða alfanumerískur strengur sem er (auk undirstrik "_", strik "-" og punktur ".") að minnsta kosti 5 stafir að lengd. Það getur verið nafnið þitt, ef þú vilt. Við munum það fyrir þig á þessari tölvu, en ef þú ferð í aðra tölvu, vinsamlegast taktu EasyEyes auðkennisskrána þína (nýjustu skrána í niðurhalsmöppunni þinni), eða skrifaðu að minnsta kosti EasyEyes auðkennið þitt niður. Notaðu það í hvert skipti til að tengja gögnin þín frá lotu til lotu.',
    id: "Loading...",
    it: 'È necessario un ID univoco per collegare i dati tra le sessioni. Questo computer ha già partecipato a una sessione su **ddd** con ID EasyEyes "**sss**". Premi OK se sei tu. In caso contrario, se hai un file ID EasyEyes, premi il pulsante di selezione file qui sotto per aprirlo. (Il nome del file inizia con "EasyEyes", termina con ".txt" e in genere si trova nella cartella Download). Se non hai un file, ma conosci il tuo ID EasyEyes, digitalo. Altrimenti, crea il tuo ID, che può essere una qualsiasi stringa alfanumerica (più trattino basso "_", trattino "-" e punto ".") di almeno 5 caratteri. Può essere anche il tuo nome, se preferisci. Lo ricorderemo su questo computer, ma se vai su un altro computer, prendi il tuo file ID EasyEyes (il file più recente nella cartella Download) o almeno annota il tuo ID EasyEyes. Usalo ogni volta per collegare i tuoi dati da una sessione all\'altra.',
    ja: "セッション間でデータをリンクするには、一意のIDが必要です。このコンピュータは以前、**ddd** のセッションに EasyEyes ID「**sss**」で参加しました。本人であれば「OK」を押してください。そうでない場合、EasyEyes ID ファイルをお持ちの場合は、下のファイル選択ボタンを押して開いてください。（ファイル名は「EasyEyes」で始まり、「.txt」で終わり、通常はダウンロードフォルダにあります。）ファイルをお持ちでないが EasyEyes ID がわかっている場合は、それを入力してください。そうでない場合は、5文字以上の英数字（アンダースコア「_」、ダッシュ「-」、ピリオド「.」を含む）からなる独自のIDを作成してください。必要に応じて、お名前を使用することもできます。このコンピュータではIDが記憶されますが、別のコンピュータを使用する際は、EasyEyes ID ファイル（ダウンロードフォルダ内の最新のファイル）をお持ちいただくか、少なくとも EasyEyes ID を書き留めておいてください。セッション間でデータをリンクする際には、毎回このIDを使用してください。",
