    nl: 'UW Android-TELEFOON. We hebben details nodig over het merk en model. Ga naar Instellingen > Over de telefoon (voorheen "Over het apparaat").\nVOOR SAMSUNG GALAXY: Kopieer de grote kop "Galaxy ..." naar Modelnaam hieronder en kopieer het modelnummer naar Modelnummer hieronder.\nVOOR MOTO G: De modelnaam en (nummer) worden gecombineerd in één regel genaamd "Model". Kopieer de naam (buiten haakjes) naar Modelnaam hieronder. Kopieer het nummer tussen haakjes, dat letters en cijfers kan bevatten, naar Modelnummer hieronder.\nVOOR ELKE ANDERE TELEFOON: Kopieer de "Productnaam" naar Modelnaam hieronder. Kopieer "Modelnaam" naar Modelnummer hieronder.',
    fi: 'Android-PUHELIMESI. Tarvitsemme sen merkin ja mallin tarkempia tietoja. Siirry kohtaan Asetukset > Tietoja puhelimesta (aiemmin "Tietoja laitteesta"). \nSAMSUNG GALAXY: Kopioi iso otsikko "Galaxy ..." alla olevaan mallin nimeen ja kopioi mallinumero alla olevaan mallinumeroon. \nMOTO G: Mallin nimi ja (numero) yhdistetään yhdeksi riviksi nimeltä "Malli". Kopioi nimi (sulkujen ulkopuolella) alla olevaan mallin nimeen. Kopioi suluissa oleva numero, joka voi sisältää kirjaimia ja numeroita, alla olevaan mallinumeroon.\nMILLOIN MUUN PUHELIN: Kopioi "Tuotteen nimi" alla olevaan mallinimeen. Kopioi "Model Name" alla olevaan mallinumeroon. ',
    fr: "Loading...",
    de: "IHR Android-TELEFON. Wir benötigen Angaben zu Marke und Modell. Gehen Sie zu Einstellungen > Telefoninfo (früher „Geräteinfo“).\nFÜR SAMSUNG GALAXY: Kopieren Sie die große Überschrift „Galaxy ...“ in den Modellnamen und die Modellnummer in die Modellnummer.\nFÜR MOTO G: Modellname und (Nummer) werden in einer Zeile mit dem Namen „Modell“ zusammengefasst. Kopieren Sie den Namen (außerhalb der Klammern) in den Modellnamen. Kopieren Sie die Nummer in Klammern, die Buchstaben und Ziffern enthalten kann, in die Modellnummer.\nFÜR ALLE ANDEREN TELEFONE: Kopieren Sie den Produktnamen in den Modellnamen. Kopieren Sie den Modellnamen in die Modellnummer.",
    el: 'ΤΟ ΤΗΛΕΦΩΝΟ ΣΑΣ Android. Χρειαζόμαστε λεπτομέρειες που να προσδιορίζουν τη μάρκα και το μοντέλο του. Μεταβείτε στις Ρυθμίσεις > Σχετικά με το τηλέφωνο (πρώην "Σχετικά με τη συσκευή"). \nΓΙΑ SAMSUNG GALAXY: Αντιγράψτε τη μεγάλη επικεφαλίδα "Galaxy ..." στο όνομα μοντέλου παρακάτω και αντιγράψτε τον αριθμό μοντέλου στον αριθμό μοντέλου παρακάτω. \nΓΙΑ MOTO G: Το όνομα του μοντέλου και ο (αριθμός) συνδυάζονται σε μια γραμμή που ονομάζεται "Model". Αντιγράψτε το όνομα (έξω από την παρένθεση) στο Όνομα μοντέλου παρακάτω. Αντιγράψτε τον αριθμό σε παρένθεση, ο οποίος μπορεί να περιλαμβάνει γράμματα και ψηφία, στον Αριθμό μοντέλου παρακάτω.\nΓΙΑ ΟΠΟΙΟΔΗΠΟΤΕ ΑΛΛΟ ΤΗΛΕΦΩΝΟ: Αντιγράψτε το "Όνομα προϊόντος" στο Όνομα μοντέλου παρακάτω. Αντιγράψτε το "Όνομα μοντέλου" στον αριθμό μοντέλου παρακάτω. ',
    he: "Loading...",
