      "您的 Android 手機。我們需要您提供其品牌和型號的詳細資訊。請前往“設定”>“關於手機”\n或“設定”>“系統”>“關於手機”（原“關於設備”）。\n請將「產品」、「設備」或「型號」的名稱以及型號複製到下方的「型號名稱和型號」欄位中。",
    hr: "Loading...",
