    da: 'DIN Android-TELEFON. Vi har brug for detaljer, der specificerer dets mærke og model. Gå til Indstillinger > Om telefonen\neller Indstillinger > System > Om telefonen (tidligere "Om enhed"). \nKopiér produktets eller enheds- eller modelnavnet og modelnummeret til felterne Modelnavn og nummer nedenfor.',
    nl: "Loading...",
    fi: "Loading...",
    fr: "Loading...",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: 'आपका Android फ़ोन। हमें इसके ब्रांड और मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। सेटिंग्स > फ़ोन के बारे में\nया सेटिंग्स > सिस्टम > फ़ोन के बारे में (पहले "डिवाइस के बारे में") पर जाएँ।\nउत्पाद या डिवाइस या मॉडल का नाम और मॉडल नंबर को नीचे दिए गए मॉडल नाम और नंबर फ़ील्ड में कॉपी करें।',
    hu: "Loading...",
    is: "Loading...",
    id: 'TELEPON Android ANDA. Kami memerlukan detail yang menyebutkan merek dan modelnya. Buka Setelan > Tentang ponsel\natau Setelan > Sistem > Tentang ponsel (sebelumnya "Tentang perangkat").\nSalin nama Produk atau Perangkat atau Model dan nomor Model ke kolom Nama dan nomor model di bawah.',
    it: "Loading...",
    ja: "Loading...",
    kn: 'ನಿಮ್ಮ Android ಫೋನ್. ಅದರ ಬ್ರ್ಯಾಂಡ್ ಮತ್ತು ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಅಗತ್ಯವಿದೆ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು ಹೋಗಿ\nಅಥವಾ ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಸಿಸ್ಟಮ್ > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಬಗ್ಗೆ"). \nಉತ್ಪನ್ನ ಅಥವಾ ಸಾಧನ ಅಥವಾ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಮಾದರಿ ಸಂಖ್ಯೆಯನ್ನು ಕೆಳಗಿನ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆ ಕ್ಷೇತ್ರಗಳಿಗೆ ನಕಲಿಸಿ.',
    ko: "Loading...",
    lt: "Loading...",
    ms: 'TELEFON Android ANDA. Kami memerlukan butiran yang menyatakan jenama dan modelnya. Pergi ke Tetapan > Perihal telefon\natau Tetapan > Sistem > Perihal telefon (dahulunya "Perihal peranti"). \nSalin Nama Produk atau Peranti atau Model dan nombor Model ke medan nama dan nombor Model di bawah.',
    ml: 'നിങ്ങളുടെ ആൻഡ്രോയിഡ് ഫോൺ. അതിൻ്റെ ബ്രാൻഡും മോഡലും വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ > ഫോണിനെക്കുറിച്ച് എന്നതിലേക്ക് പോകുക\nഅല്ലെങ്കിൽ ക്രമീകരണങ്ങൾ > സിസ്റ്റം > ഫോണിനെക്കുറിച്ച് (മുമ്പ് "ഉപകരണത്തെക്കുറിച്ച്"). \nഉൽപ്പന്നം അല്ലെങ്കിൽ ഉപകരണം അല്ലെങ്കിൽ മോഡലിൻ്റെ പേരും മോഡൽ നമ്പറും ചുവടെയുള്ള മോഡൽ നാമത്തിലേക്കും നമ്പർ ഫീൽഡുകളിലേക്കും പകർത്തുക.',
    no: "Loading...",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: "Loading...",
    sw: "Loading...",
    sv: "Loading...",
    tl: 'IYONG Android PHONE. Kailangan namin ng mga detalyeng tumutukoy sa tatak at modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono\no Mga Setting > System > Tungkol sa telepono (dating "Tungkol sa device"). \nKopyahin ang Pangalan ng Produkto o Device o Modelo at numero ng Modelo sa mga field ng Pangalan ng Modelo at numero sa ibaba.',
    tr: "Loading...",
    ur: 'آپ کا Android فون۔ ہمیں اس کے برانڈ اور ماڈل کی تفصیلات کی ضرورت ہے۔ ترتیبات > فون کے بارے میں پر جائیں۔\nیا سیٹنگز > سسٹم > فون کے بارے میں (پہلے "آلہ کے بارے میں")۔ \nپروڈکٹ یا ڈیوائس یا ماڈل کا نام اور ماڈل نمبر نیچے ماڈل کے نام اور نمبر والے فیلڈز میں کاپی کریں۔',
