    lt: "JŪSŲ „Blackberry“ TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Modelis PAVADINIMAS ir (NUMBER) yra sujungti į vieną eilutę, pavadintą „Modelis“. Nukopijuokite pavadinimą prieš skliaustus į žemiau esantį modelio pavadinimą. Nukopijuokite raides ir skaičius skliausteliuose į toliau pateiktą modelio numerį.",
    ms: 'TELEFON Blackberry ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Model NAME dan (NUMBER) digabungkan menjadi satu baris yang dipanggil "Model". Salin nama sebelum kurungan ke nama Model di bawah. Salin huruf dan nombor di dalam kurungan ke nombor Model di bawah.',
