    el: "Loading...",
    he: 'האייפון שלך. אנחנו צריכים שני פרטים המציינים את הדגם של האייפון שלך. בטלפון, עבור אל הגדרות > כללי > אודות. \n\n1. שם הדגם. אם הוא פועל עם iOS 12.2 ואילך, העתק את שם הדגם לשדה למטה. אם הוא מפעיל iOS ישן יותר, ראה LAST RESORT למטה.\n\n2. מספר "A" נסתר. אם אתה מפעיל iOS 10 ואילך, הקשה על מספר הדגם תחשוף את המספר "A" המוסתר: "A" ואחריו ארבע ספרות, כמו A1234. העתק את מספר A לשדה למטה. \nאם זה iPhone 8 ואילך, עם מגש SIM, הסר את מגש ה-SIM וחפש את המספר A בחריץ. אם אין מגש SIM, חפש את המספר A במחבר Lightning או USB-C. ודא שאתה נמצא במקום עם אור בהיר מעל הראש. המספר A נמצא בצד העליון - הצד עם התצוגה. העתק את מספר A לשדה למטה. \nאם האייפון ישן יותר מהאייפון 8, המספר A מודפס בגב כמשהו כמו "דגם A1234". העתק את מספר A לשדה למטה. \n\nמוצא אחרון. אם יש לך ChapGPT או שווה ערך, העתק את מספר הדגם של האייפון, למשל. MD298HB/A, מהדף אודות שלו ובקש מ-ChatGPT את שם הדגם שלו ומספר A שלו.',
    hi: "Loading...",
