    ar: 'جهاز iPad الخاص بك. نحتاج إلى تفاصيل طرازه. انتقل إلى الإعدادات > عام > حول. انسخ "اسم الطراز" في الحقل أدناه. ثم انقر على "رقم الطراز" لإظهار رقم "A" المخفي: "A" متبوعًا بأربعة أرقام. اكتبه في الحقل أدناه.',
