    fi: "Loading...",
    fr: "Loading...",
    de: "Loading...",
    el: "Loading...",
    he: 'האייפד שלך. אנחנו צריכים פרטים המפרטים את הדגם שלו. עבור אל הגדרות > כללי > אודות. העתק את "שם הדגם" לשדה למטה. לאחר מכן הקש על "מספר דגם" כדי לחשוף את המספר "A" המוסתר: "A" ואחריו ארבע ספרות. הקלד את זה בשדה למטה.',
    hi: 'आपका iPad. हमें इसके मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। सेटिंग्स > सामान्य > अबाउट पर जाएँ। "मॉडल नाम" को नीचे दिए गए फ़ील्ड में कॉपी करें। फिर "मॉडल नंबर" पर टैप करें ताकि छिपा हुआ "A" नंबर दिखाई दे: एक "A" जिसके बाद चार अंक हैं। इसे नीचे दिए गए फ़ील्ड में टाइप करें।',
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: "Loading...",
    ja: "お使いのiPad。モデルを特定する詳細情報が必要です。「設定」>「一般」>「情報」に移動してください。「モデル名」を下の欄にコピーしてください。次に「モデル番号」をタップすると、隠された「A」番号（「A」に続く4桁の数字）が表示されます。下の欄に入力してください。",
    kn: "Loading...",
    ko: 'iPad입니다. 모델명을 입력해 주세요. 설정 > 일반 > 정보로 이동하세요. "모델명"을 아래 필드에 복사하세요. 그런 다음 "모델 번호"를 탭하면 숨겨진 "A" 번호가 나타납니다. "A" 뒤에 네 자리 숫자가 있습니다. 아래 필드에 입력하세요.',
    lt: "JŪSŲ iPad. Mums reikia detalių, nurodančių jos modelį. Eikite į Nustatymai > Bendrieji > Apie. Nukopijuokite „Modelio pavadinimą“ į žemiau esantį lauką. Tada bakstelėkite „Modelio numerį“, kad atskleistumėte paslėptą „A“ skaičių: „A“, po kurio seka keturi skaitmenys. Įveskite tai į žemiau esantį lauką.",
    ms: "Loading...",
    ml: 'നിങ്ങളുടെ ഐപാഡ്. അതിൻ്റെ മാതൃക വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ > പൊതുവായത് > കുറിച്ച് എന്നതിലേക്ക് പോകുക. "മോഡൽ നെയിം" താഴെയുള്ള ഫീൽഡിലേക്ക് പകർത്തുക. തുടർന്ന് മറഞ്ഞിരിക്കുന്ന "A" നമ്പർ വെളിപ്പെടുത്താൻ "മോഡൽ നമ്പർ" ടാപ്പുചെയ്യുക: ഒരു "A" തുടർന്ന് നാല് അക്കങ്ങൾ. താഴെയുള്ള ഫീൽഡിൽ അത് ടൈപ്പ് ചെയ്യുക.',
    no: 'DIN iPad. Vi trenger detaljer som spesifiserer modellen. Gå til Innstillinger > Generelt > Om. Kopier "modellnavnet" til feltet nedenfor. Trykk deretter på "Modelnummer" for å avsløre det skjulte "A"-nummeret: en "A" etterfulgt av fire sifre. Skriv det inn i feltet nedenfor.',
    fa: 'آی پد شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به Settings > General > About بروید. "نام مدل" را در قسمت زیر کپی کنید. سپس روی "شماره مدل" ضربه بزنید تا عدد "A" پنهان نمایان شود: یک "A" به دنبال چهار رقم. آن را در فیلد زیر تایپ کنید.',
    pl: "Loading...",
    pt: 'SEU iPad. Precisamos de detalhes especificando o modelo. Vá em Ajustes > Geral > Sobre. Copie o "Nome do Modelo" para o campo abaixo. Em seguida, toque em "Número do Modelo" para revelar o número "A" oculto: um "A" seguido de quatro dígitos. Digite-o no campo abaixo.',
    ro: "Loading...",
