    lt: "Loading...",
    ms: "TELEFON Telapak tangan ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke menu Tetapan atau Pilihan, tatal ke bahagian bawah senarai, dan semak ‘Perihal telefon’, ‘Perihal peranti’ atau yang serupa. Salin Nama Model dan Nombor ke medan yang sepadan di bawah.",
    ml: "നിങ്ങളുടെ പാം ഫോൺ. അതിൻ്റെ മാതൃക വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ അല്ലെങ്കിൽ ഓപ്ഷനുകൾ മെനുവിലേക്ക് പോകുക, ലിസ്റ്റിൻ്റെ താഴേക്ക് സ്ക്രോൾ ചെയ്യുക, തുടർന്ന് 'ഫോണിനെക്കുറിച്ച്', 'ഉപകരണത്തെക്കുറിച്ച്' അല്ലെങ്കിൽ സമാനമായത് പരിശോധിക്കുക. ചുവടെയുള്ള അനുബന്ധ ഫീൽഡുകളിലേക്ക് മോഡലിൻ്റെ പേരും നമ്പറും പകർത്തുക.",
    no: 'DIN Palm-TELEFON. Vi trenger detaljer som spesifiserer modellen. Gå til menyen Innstillinger eller Alternativer, bla til bunnen av listen, og merk av for "Om telefon", "Om enhet" eller lignende. Kopier modellnavnet og -nummeret til de tilsvarende feltene nedenfor.',
    fa: "تلفن کف دست شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به منوی تنظیمات یا گزینه‌ها بروید، به پایین لیست بروید و «درباره تلفن»، «درباره دستگاه» یا موارد مشابه را علامت بزنید. نام و شماره مدل را در فیلدهای مربوطه در زیر کپی کنید.",
    pl: "Loading...",
    pt: 'SEU TELEFONE Palm. Precisamos de detalhes especificando o modelo. Acesse o menu Configurações ou Opções, role até o final da lista e marque "Sobre o telefone", "Sobre o dispositivo" ou similar. Copie o Nome e o Número do Modelo nos campos correspondentes abaixo.',
