    ru: "ВАШ ТЕЛЕФОН WebOS. Нам нужны данные, указывающие его модель. Перейдите в меню «Настройки» или «Параметры», прокрутите список до конца и отметьте «О телефоне», «Об устройстве» или что-то подобное. Скопируйте название модели и номер в соответствующие поля ниже.",
    sr: "ВАШ ВебОС ТЕЛЕФОН. Потребни су нам детаљи који прецизирају његов модел. Идите на мени Подешавања или Опције, скролујте до дна листе и означите „О телефону“, „О уређају“ или слично. Копирајте назив модела и број у одговарајућа поља испод.",
    es: "Loading...",
