      "❌ Sorry, the phone is slow in responding, and might be disconnected. You can:\n1. WAIT longer. Click the WAIT button.\n2. TRY AGAIN by pressing the CALIBRATE button.\n3. UPGRADE THE PHONE'S BROWSER. Compatible phone browsers include: Safari 12+ and Chrome 133+. Might this phone’s BBB 111 browser be too old for compatibility? In that case, you might make this phone compatible by upgrading its browser. Either upgrade to a newer OS version (and thus upgrade any built-in browser), or install a new browser, e.g. Chrome, and make it the default browser. Once the phone’s browser is upgraded, press the CALIBRATE button.\n4. TRY ANOTHER PHONE. Press the CALIBRATE button.\n5. END the session by pressing the EXIT button.",
    "en-US_1":
      "❌ Sorry, the phone is slow in responding, and might be disconnected. You can:\n1. WAIT longer. Click the WAIT button.\n2. TRY AGAIN by pressing the CALIBRATE button.\n3. UPGRADE THE PHONE'S BROWSER. Compatible phone browsers include: Safari 12+ and Chrome 133+. Might this phone’s BBB 111 browser be too old for compatibility? In that case, you might make this phone compatible by upgrading its browser. Either upgrade to a newer OS version (and thus upgrade any built-in browser), or install a new browser, e.g. Chrome, and make it the default browser. Once the phone’s browser is upgraded, press the CALIBRATE button.\n4. TRY ANOTHER PHONE. Press the CALIBRATE button.\n5. END the session by pressing the EXIT button.",
    ar: "Loading...",
    hy: "Loading...",
    bg: "❌ Съжаляваме, но телефонът реагира бавно и може да бъде прекъснат. Можете да:\n1. ИЗЧАКАЙТЕ още. Щракнете върху бутона ИЗЧАКАЙТЕ.\n2. ОПИТАЙТЕ ОТНОВО, като натиснете бутона КАЛИБРИРАНЕ.\n3. НАДГРЕЙДЕ БРАУЗЪРА НА ТЕЛЕФОНА. Съвместимите телефонни браузъри включват: Safari 12+ и Chrome 133+. Възможно ли е браузърът BBB 111 на този телефон да е твърде стар за съвместимост? В такъв случай можете да направите този телефон съвместим, като надстроите неговия браузър. Или надстройте до по-нова версия на ОС (и по този начин надстройте всеки вграден браузър), или инсталирайте нов браузър, напр. Chrome и го направете браузър по подразбиране. След като браузърът на телефона бъде надстроен, натиснете бутона КАЛИБРИРАНЕ.\n4. ОПИТАЙТЕ С ДРУГ ТЕЛЕФОН. Натиснете бутона КАЛИБРИРАНЕ.\n5. КРАЙ на сесията, като натиснете бутона EXIT.",
    "zh-CN": "Loading...",
    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "❌ Je nám líto, telefon reaguje pomalu a může být odpojen. Můžete:\n1. ČEKEJTE déle. Klikněte na tlačítko ČEKEJTE.\n2. ZKUSTE TO ZNOVU stisknutím tlačítka KALIBRACE.\n3. AKTUALIZUJTE PROHLÍŽEČ TELEFONU. Mezi kompatibilní prohlížeče telefonu patří: Safari 12+ a Chrome 133+. Může být prohlížeč BBB 111 tohoto telefonu příliš starý na kompatibilitu? V takovém případě můžete tento telefon učinit kompatibilním upgradem jeho prohlížeče. Buď upgradujte na novější verzi OS (a tím upgradujte libovolný vestavěný prohlížeč), nebo nainstalujte nový prohlížeč, např. Chrome a nastavte jej jako výchozí prohlížeč. Jakmile je prohlížeč v telefonu upgradován, stiskněte tlačítko KALIBROVAT.\n4. VYZKOUŠEJTE JINÝ TELEFON. Stiskněte tlačítko CALIBRATE.\n5. Ukončete relaci stisknutím tlačítka EXIT.",
    da: "Loading...",
    nl: "❌ Sorry, de telefoon reageert traag en de verbinding is mogelijk verbroken. Je kunt:\n1. Langer WACHTEN. Klik op de knop WACHTEN.\n2. OPNIEUW PROBEREN door op de knop KALIBREREN te drukken.\n3. DE BROWSER VAN DE TELEFOON UPGRADEN. Compatibele telefoonbrowsers zijn onder andere: Safari 12+ en Chrome 133+. Is de BBB 111-browser van deze telefoon mogelijk te oud voor compatibiliteit? In dat geval kun je deze telefoon compatibel maken door de browser te upgraden. Upgrade naar een nieuwere OS-versie (en upgrade daarmee de ingebouwde browser), of installeer een nieuwe browser, bijvoorbeeld Chrome, en stel deze in als standaardbrowser. Zodra de browser van de telefoon is geüpgraded, druk je op de knop KALIBREREN.\n4. EEN ANDERE TELEFOON PROBEREN. Druk op de knop KALIBREREN.\n5. DE SESSIE BEËINDIGEN door op de knop AFSLUITEN te drukken.",
