    id: "❌ Maaf, ponsel lambat merespons, dan mungkin terputus. Anda dapat:\n1. MENUNGGU lebih lama. Klik tombol TUNGGU.\n2. COBA LAGI dengan menekan tombol KALIBRASI.\n3. TINGKATKAN BROWSER TELEPON. Browser telepon yang kompatibel meliputi: Safari 12+ dan Chrome 133+. Mungkinkah browser BBB 111 telepon ini terlalu lama untuk kompatibilitas? Dalam hal itu, Anda dapat membuat telepon ini kompatibel dengan memutakhirkan browsernya. Tingkatkan ke versi OS yang lebih baru (dan dengan demikian tingkatkan browser bawaan apa pun), atau instal browser baru, misalnya Chrome, dan jadikan sebagai browser default. Setelah browser telepon ditingkatkan, tekan tombol KALIBRASI.\n4. COBA TELEPON LAIN. Tekan tombol KALIBRASI.\n5. AKHIR sesi dengan menekan tombol KELUAR.",
    it: "Loading...",
    ja: "❌ 申し訳ございませんが、電話の応答が遅く、接続が切断されている可能性があります。以下の方法をお試しください。\n1. もう少しお待ちください。「待機」ボタンをクリックしてください。\n2. 「調整」ボタンを押して再試行してください。\n3. 電話のブラウザをアップグレードしてください。対応ブラウザはSafari 12以降およびChrome 133以降です。この電話のBBB 111ブラウザは古すぎて互換性がない可能性があります。その場合は、ブラウザをアップグレードすることで互換性を確保できる可能性があります。新しいOSバージョンにアップグレードするか（内蔵ブラウザもアップグレードする）、Chromeなどの新しいブラウザをインストールしてデフォルトのブラウザに設定してください。電話のブラウザがアップグレードされたら、「調整」ボタンを押してください。\n4. 別の電話を試してください。「調整」ボタンを押してください。\n5. 「終了」ボタンを押してセッションを終了してください。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "❌ Maaf, telefon lambat bertindak balas dan mungkin terputus sambungan. Anda boleh:\n1. TUNGGU lagi. Klik butang TUNGGU.\n2. CUBA LAGI dengan menekan butang CALIBRATE.\n3. NAIK TARAF PENYEMBARA TELEFON. Penyemak imbas telefon yang serasi termasuk: Safari 12+ dan Chrome 133+. Mungkinkah penyemak imbas BBB 111 telefon ini terlalu lama untuk keserasian? Dalam kes itu, anda mungkin menjadikan telefon ini serasi dengan menaik taraf penyemak imbasnya. Sama ada naik taraf kepada versi OS yang lebih baharu (dan dengan itu tingkatkan mana-mana penyemak imbas terbina dalam), atau pasang penyemak imbas baharu, mis. Chrome, dan jadikannya penyemak imbas lalai. Setelah penyemak imbas telefon dinaik taraf, tekan butang CALIBRATE.\n4. CUBA TELEFON LAIN. Tekan butang CALIBRATE.\n5. TAMAT sesi dengan menekan butang KELUAR.",
    ml: "❌ ക്ഷമിക്കണം, ഫോൺ പ്രതികരിക്കുന്നതിൽ മന്ദഗതിയിലാണ്, വിച്ഛേദിക്കപ്പെട്ടേക്കാം. നിങ്ങൾക്ക് കഴിയും:\n1. കൂടുതൽ സമയം കാത്തിരിക്കുക. WAIT ബട്ടണിൽ ക്ലിക്ക് ചെയ്യുക.\n2. കാലിബ്രേറ്റ് ബട്ടൺ അമർത്തി വീണ്ടും ശ്രമിക്കുക.\n3. ഫോണിൻ്റെ ബ്രൗസർ അപ്‌ഗ്രേഡ് ചെയ്യുക. അനുയോജ്യമായ ഫോൺ ബ്രൗസറുകളിൽ ഉൾപ്പെടുന്നു: Safari 12+, Chrome 133+. ഈ ഫോണിൻ്റെ BBB 111 ബ്രൗസർ അനുയോജ്യതയ്ക്ക് വളരെ പഴയതായിരിക്കുമോ? അങ്ങനെയെങ്കിൽ, ഈ ഫോണിൻ്റെ ബ്രൗസർ അപ്‌ഗ്രേഡ് ചെയ്‌ത് നിങ്ങൾക്ക് അനുയോജ്യമാക്കാം. ഒന്നുകിൽ ഒരു പുതിയ OS പതിപ്പിലേക്ക് അപ്‌ഗ്രേഡ് ചെയ്യുക (അങ്ങനെ ഏതെങ്കിലും അന്തർനിർമ്മിത ബ്രൗസർ അപ്‌ഗ്രേഡ് ചെയ്യുക), അല്ലെങ്കിൽ ഒരു പുതിയ ബ്രൗസർ ഇൻസ്റ്റാൾ ചെയ്യുക, ഉദാ. Chrome, അതിനെ സ്ഥിരസ്ഥിതി ബ്രൗസറാക്കുക. ഫോണിൻ്റെ ബ്രൗസർ അപ്‌ഗ്രേഡ് ചെയ്‌തുകഴിഞ്ഞാൽ, കാലിബ്രേറ്റ് ബട്ടൺ അമർത്തുക.\n4. മറ്റൊരു ഫോൺ പരീക്ഷിക്കുക. കാലിബ്രേറ്റ് ബട്ടൺ അമർത്തുക.\n5. എക്സിറ്റ് ബട്ടൺ അമർത്തി സെഷൻ അവസാനിപ്പിക്കുക.",
    no: "❌ Beklager, telefonen svarer treg og kan være frakoblet. Du kan:\n1. VENT lenger. Klikk på VENT-knappen.\n2. PRØV IGJEN ved å trykke på CALIBRATE-knappen.\n3. OPPGRADER TELEFONENS NETTLESER. Kompatible telefonnettlesere inkluderer: Safari 12+ og Chrome 133+. Kan denne telefonens BBB 111-nettleser være for gammel for kompatibilitet? I så fall kan du gjøre denne telefonen kompatibel ved å oppgradere nettleseren. Enten oppgradere til en nyere OS-versjon (og dermed oppgradere hvilken som helst innebygd nettleser), eller installer en ny nettleser, f.eks. Chrome, og gjør den til standard nettleser. Når telefonens nettleser er oppgradert, trykker du på KALIBRER-knappen.\n4. PRØV EN ANNEN TELEFON. Trykk på KALIBRER-knappen.\n5. AVSLUTT økten ved å trykke på EXIT-knappen.",
