    ru: "РУКОВОДСТВО ПО УСТАНОВКЕ ПРИНТЕРА ЭТИКЕТОК DYMO\nВыполните следующие шаги, чтобы помочь этому исследованию напечатать этикетки на вашем DYMO LabelWriter 550.\n① Установите программное обеспечение DYMO\nЗагрузите и установите последнюю версию программного обеспечения DYMO для вашей ОС с веб-сайта поддержки DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nВ своем браузере перейдите по адресу:\nDYMO.WebApi.Mac.Host:\nУбедитесь, что DYMO.WebApi.Mac.Host запущен.\n② Настройте свой браузер\n▶ Chrome\nПерейдите по адресу:\nchrome://flags\nНайдите TLS в строке поиска.\nВ результатах TLS отключите:\n⚬ Ранние данные TLS 1.3\n⚬ Соглашение о ключах TLS 1.3 после квантового сканирования\n⚬ Использовать ML-KEM в TLS 1.3\n⚬ Пропустить клиентские сертификаты TLS, если режим учетных данных запрещен.\nНажмите ПЕРЕЗАПУСТИТЬ внизу.\n▶ Firefox\nПерейдите в Настройки → Поиск сертификата.\nСнимите флажок «Разрешить Firefox автоматически доверять сторонним корневым сертификатам...»\nПерезапустите Firefox.\n▶ Safari\nПерейдите по адресу:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nЕсли будет предложено, выберите\n«Показать подробности» → «Посетить этот веб-сайт»,\nчтобы обойти предупреждение системы безопасности.\n③ Распечатать этикетку\nУбедитесь, что DYMO.WebApi.Mac.Host запущен.\nНажмите кнопку ПЕЧАТЬ ЭТИКЕТКИ на этой странице.\n\nПРОБЛЕМА: Если вы все еще не можете печатать, убедитесь, что DYMO.WebApi.Mac.Host запущен, или обратитесь в официальную службу поддержки DYMO.\nВНИМАНИЕ: Повторно включите все настройки безопасности после печати, чтобы обеспечить максимальную защиту вашего браузера.",
