    ar: '١. يحتوي هذا الكمبيوتر على ١١١ كاميرا.\n\n٢. تتتبع هذه الدراسة النظرة أو مسافة المشاهدة، ولذلك تحتاج إلى كاميرا في الحافة العلوية للشاشة، لذا يُرجى اختيار شاشة مزودة بكاميرا في الحافة العلوية.\n\n٣. يُرجى سحب هذه النافذة إلى الشاشة التي ترغب في استخدامها لهذه الدراسة.\n\n٤. يكفي أن تكون معظم وقتك على تلك الشاشة.\n\n٥. ثم انقر على "متابعة" أو "رجوع".',
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN":
      "1. 这台电脑有 111 个摄像头。\n2. 这项研究会追踪视线或观看距离，因此需要在屏幕顶部边缘安装一个摄像头，因此请选择带有顶部边缘摄像头的屏幕。\n3. 请将此窗口拖动到您想要用于此研究的屏幕上。\n4. 大部分内容在该屏幕上即可。\n5. 然后点击“继续”或按“返回”。",
    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "1. Tento počítač má 111 kamer. \n2. Tato studie sleduje pohled nebo pozorovací vzdálenost, pro kterou potřebuje kameru na horním okraji obrazovky, vyberte si prosím obrazovku s kamerou na horní hraně. \n3. Přetáhněte toto okno na kteroukoli obrazovku, kterou chcete pro tuto studii použít.\n4. Stačí být většinou na té obrazovce.\n5. Poté klikněte na POKRAČOVAT nebo stiskněte RETURN.",
    da: "Loading...",
    nl: "1. Deze computer heeft 111 camera('s).\n2. Deze studie registreert de blikrichting of kijkafstand, waarvoor een camera aan de bovenrand van het scherm nodig is. Kies daarom een ​​scherm met een camera aan de bovenrand.\n3. Sleep dit venster naar het scherm dat u voor deze studie wilt gebruiken.\n4. Het is voldoende om voornamelijk op dat scherm te zijn.\n5. Klik vervolgens op DOORGAAN of druk op RETURN.",
    fi: "Loading...",
    fr: "Loading...",
    de: "Loading...",
    el: "Loading...",
    he: "1. במחשב זה יש 111 מצלמות. \n2. מחקר זה עוקב אחר מבט או מרחק צפייה, עבורם הוא זקוק למצלמה בקצה העליון של המסך, אז אנא בחר מסך עם מצלמה בקצה העליון. \n3. אנא גרור את החלון הזה לאיזה מסך שתרצה להשתמש בו למחקר זה.\n4. מספיק להיות בעיקר על המסך הזה.\n5. לאחר מכן לחץ על המשך או הקש על RETURN.",
    hi: "1. इस कंप्यूटर में 111 कैमरे हैं। \n2. यह अध्ययन टकटकी या देखने की दूरी को ट्रैक करता है, जिसके लिए इसे स्क्रीन के ऊपरी किनारे पर एक कैमरा की आवश्यकता होती है, इसलिए कृपया ऊपरी किनारे वाले कैमरे वाली स्क्रीन चुनें। \n3. कृपया इस विंडो को उस स्क्रीन पर खींचें जिसे आप इस अध्ययन के लिए उपयोग करना चाहते हैं। \n4. उस स्क्रीन पर ज़्यादातर समय रहना ही पर्याप्त है। \n5. फिर आगे बढ़ें पर क्लिक करें या रिटर्न दबाएँ।",
    hu: "Loading...",
    is: "Loading...",
    id: "1. Komputer ini memiliki 111 kamera. \n2. Studi ini melacak jarak pandang, yang memerlukan kamera di tepi atas layar, jadi pilihlah layar dengan kamera di tepi atas. \n3. Geser jendela ini ke layar mana pun yang ingin Anda gunakan untuk studi ini.\n4. Sebagian besar gambar di layar itu sudah cukup.\n5. Kemudian klik LANJUTKAN atau tekan RETURN.",
    it: "Loading...",
    ja: "1. このコンピュータには111台のカメラが搭載されています。\n2. この研究では視線または視距離を追跡するため、画面の上端にカメラが必要です。そのため、上端にカメラがある画面を選択してください。\n3. このウィンドウを、この研究に使用する画面にドラッグしてください。\n4. ほぼその画面に収まれば十分です。\n5. 次に、「続行」をクリックするか、Enterキーを押してください。",
    kn: "1. ಈ ಕಂಪ್ಯೂಟರ್ 111 ಕ್ಯಾಮೆರಾ(ಗಳನ್ನು) ಹೊಂದಿದೆ. \n2. ಈ ಅಧ್ಯಯನವು ನೋಟ ಅಥವಾ ವೀಕ್ಷಣಾ ದೂರವನ್ನು ಟ್ರ್ಯಾಕ್ ಮಾಡುತ್ತದೆ, ಇದಕ್ಕಾಗಿ ಪರದೆಯ ಮೇಲ್ಭಾಗದ ತುದಿಯಲ್ಲಿ ಕ್ಯಾಮರಾ ಅಗತ್ಯವಿದೆ, ಆದ್ದರಿಂದ ದಯವಿಟ್ಟು ಮೇಲ್ಭಾಗದ ಕ್ಯಾಮೆರಾ ಹೊಂದಿರುವ ಪರದೆಯನ್ನು ಆಯ್ಕೆಮಾಡಿ. \n3. ಈ ಅಧ್ಯಯನಕ್ಕಾಗಿ ನೀವು ಬಳಸಲು ಬಯಸುವ ಯಾವುದೇ ಪರದೆಗೆ ದಯವಿಟ್ಟು ಈ ವಿಂಡೋವನ್ನು ಎಳೆಯಿರಿ.\n4. ಆ ಪರದೆಯ ಮೇಲೆ ಹೆಚ್ಚಾಗಿ ಇದ್ದರೆ ಸಾಕು.\n5. ನಂತರ ಮುಂದುವರಿಸು ಕ್ಲಿಕ್ ಮಾಡಿ ಅಥವಾ ರಿಟರ್ನ್ ಒತ್ತಿರಿ.",
    ko: "1. 이 컴퓨터에는 111개의 카메라가 있습니다.\n2. 이 연구는 시선 또는 시청 거리를 추적하므로 화면 상단 가장자리에 카메라가 필요합니다. 따라서 상단 가장자리 카메라가 있는 화면을 선택해 주세요.\n3. 이 창을 연구에 사용할 화면으로 드래그해 주세요.\n4. 대부분 해당 화면에 있으면 충분합니다.\n5. 그런 다음 '계속'을 클릭하거나 '돌아가기'를 누르세요.",
    lt: "Loading...",
    ms: "1. Komputer ini mempunyai 111 kamera. \n2. Kajian ini menjejaki pandangan atau jarak tontonan, yang mana ia memerlukan kamera di tepi atas skrin, jadi sila pilih skrin dengan kamera tepi atas. \n3. Sila seret tetingkap ini ke mana-mana skrin yang anda ingin gunakan untuk kajian ini.\n4. Cukuplah untuk berada pada skrin itu.\n5. Kemudian klik PROCEED atau tekan RETURN.",
    ml: "1. ഈ കമ്പ്യൂട്ടറിൽ 111 ക്യാമറ(കൾ) ഉണ്ട്. \n2. ഈ പഠനം നോട്ടം അല്ലെങ്കിൽ കാഴ്ച ദൂരം ട്രാക്ക് ചെയ്യുന്നു, അതിന് സ്ക്രീനിൻ്റെ മുകൾ ഭാഗത്ത് ഒരു ക്യാമറ ആവശ്യമാണ്, അതിനാൽ ദയവായി ഒരു ടോപ്പ് എഡ്ജ് ക്യാമറയുള്ള ഒരു സ്ക്രീൻ തിരഞ്ഞെടുക്കുക. \n3. ഈ പഠനത്തിനായി നിങ്ങൾ ഉപയോഗിക്കാൻ ആഗ്രഹിക്കുന്ന സ്ക്രീനിലേക്ക് ഈ വിൻഡോ വലിച്ചിടുക.\n4. മിക്കവാറും ആ സ്‌ക്രീനിൽ ഉണ്ടായാൽ മതി.\n5. തുടർന്ന് PROCEED ക്ലിക്ക് ചെയ്യുക അല്ലെങ്കിൽ RETURN അമർത്തുക.",
    no: "1. Denne datamaskinen har 111 kamera(er). \n2. Denne studien sporer blikk eller visningsavstand, som den trenger et kamera i øverste kant av skjermen for, så velg en skjerm med toppkamera. \n3. Dra dette vinduet til hvilken skjerm du vil bruke for denne studien.\n4. Det er nok å være mest på den skjermen.\n5. Klikk deretter FORTSETT eller trykk RETURN.",
