    ml: "കണക്ഷൻ നഷ്ടപ്പെട്ടു. ഈ പേജ് പുതുക്കി വീണ്ടും ബന്ധിപ്പിക്കുക. പുതുക്കാൻ, വിലാസ ബാറിലെ പുതുക്കൽ ഐക്കൺ ⟳ ടാപ്പ് ചെയ്യുക. അല്ലെങ്കിൽ വിലാസം ടാപ്പുചെയ്‌ത് RETURN അമർത്തുക. അല്ലെങ്കിൽ ഒരു ഡ്രോപ്പ്-ഡൗൺ മെനു ലഭിക്കുന്നതിന് മെനു ബാറിലെ “…” അല്ലെങ്കിൽ “⋮“ ടാപ്പുചെയ്യുക, അതിൽ നിന്ന് “പുതുക്കുക” അല്ലെങ്കിൽ “റീലോഡ്” തിരഞ്ഞെടുക്കുക.",
    no: 'Forbindelsen mistet. Koble til på nytt ved å oppdatere denne siden. For å oppdatere, trykk bare på oppdateringsikonet ⟳ i adressefeltet. Eller trykk på adressen og trykk RETURN. Eller trykk på "..." eller "⋮" i menylinjen for å få en rullegardinmeny, og fra den velger du "Refresh" eller "Reload".',
