    fr: "Cette étude nécessite l'utilisation de la webcam. L'autorisation d'accès à votre webcam est facultative, mais nous ne pouvons pas continuer sans elle. Si vous avez répondu « Non » par erreur et souhaitez maintenant autoriser l'accès à votre caméra, vous pouvez le faire. Appuyez d'abord sur la touche ÉCHAP pour afficher la barre d'adresse. Ensuite, recherchez l'icône de la caméra dans la barre d'adresse, cliquez dessus, autorisez l'accès à la caméra et actualisez la page. Pour actualiser la page, appuyez sur l'icône d'actualisation « ⟳ » dans la barre d'adresse.",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Studi ini perlu menggunakan webcam. Memberikan akses ke webcam Anda bersifat opsional, tetapi kami tidak dapat melanjutkan tanpanya. Jika Anda menjawab Tidak secara tidak sengaja dan sekarang ingin memberikan akses ke kamera Anda, Anda dapat melakukannya. Pertama-tama tekan tombol ESCAPE untuk menampilkan bilah alamat. Kemudian temukan ikon kamera di bilah alamat, klik ikon tersebut, izinkan akses kamera, dan segarkan halaman. Untuk menyegarkan halaman, ketuk ikon segarkan “⟳” di bilah alamat.",
    it: "Loading...",
    ja: "この調査ではウェブカメラを使用する必要があります。ウェブカメラへのアクセスを許可するかどうかは任意ですが、許可しないと調査を続行できません。誤って「いいえ」と選択した場合、カメラへのアクセスを許可できます。まずESCAPEキーを押してアドレスバーを表示してください。アドレスバーにあるカメラアイコンを見つけてクリックし、カメラへのアクセスを許可してページを更新してください。ページを更新するには、アドレスバーの更新アイコン「⟳」をタップしてください。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: 'ഈ പഠനത്തിന് വെബ്‌ക്യാം ഉപയോഗിക്കേണ്ടതുണ്ട്. നിങ്ങളുടെ വെബ്‌ക്യാമിലേക്ക് ആക്‌സസ് അനുവദിക്കുന്നത് ഓപ്‌ഷണലാണ്, എന്നാൽ ഇത് കൂടാതെ ഞങ്ങൾക്ക് തുടരാനാകില്ല. നിങ്ങൾ അബദ്ധവശാൽ ഇല്ല എന്ന് പറയുകയും ഇപ്പോൾ നിങ്ങളുടെ ക്യാമറയിലേക്ക് ആക്‌സസ് അനുവദിക്കാൻ ആഗ്രഹിക്കുകയും ചെയ്യുന്നുവെങ്കിൽ, നിങ്ങൾക്ക് കഴിയും. വിലാസ ബാർ വെളിപ്പെടുത്താൻ ആദ്യം ESCAPE കീ അമർത്തുക. തുടർന്ന് വിലാസ ബാറിൽ ക്യാമറ ഐക്കൺ കണ്ടെത്തുക, അതിൽ ക്ലിക്ക് ചെയ്യുക, ക്യാമറ ആക്‌സസ് അനുവദിക്കുക, പേജ് പുതുക്കുക. പേജ് പുതുക്കാൻ, വിലാസ ബാറിലെ പുതുക്കിയ ഐക്കൺ "⟳" ടാപ്പ് ചെയ്യുക.',
    no: 'Denne studien må bruke webkameraet. Å gi tilgang til webkameraet ditt er valgfritt, men vi kan ikke fortsette uten det. Hvis du sa nei ved en feil og nå ønsker å gi tilgang til kameraet ditt, kan du. Trykk først på ESCAPE-tasten for å vise adressefeltet. Finn deretter kameraikonet i adressefeltet, klikk på det, tillat kameratilgang og oppdater siden. For å oppdatere siden, trykk på oppdateringsikonet "⟳" i adressefeltet.',
    fa: "Loading...",
    pl: "Loading...",
    pt: 'Este estudo precisa usar a webcam. Conceder acesso à sua webcam é opcional, mas não podemos continuar sem ela. Se você respondeu "Não" por engano e agora deseja conceder acesso à sua câmera, você pode. Primeiro, pressione a tecla ESCAPE para exibir a barra de endereço. Em seguida, encontre o ícone da câmera na barra de endereço, clique nele, permita o acesso à câmera e atualize a página. Para atualizar a página, toque no ícone de atualização "⟳" na barra de endereço.',
    ro: "Loading...",
    ru: "Это исследование требует использования веб-камеры. Предоставление доступа к вашей веб-камере необязательно, но мы не можем продолжать без этого. Если вы сказали «Нет» по ошибке и теперь хотите предоставить доступ к своей камере, вы можете это сделать. Сначала нажмите клавишу ESCAPE, чтобы открыть адресную строку. Затем найдите значок камеры в адресной строке, щелкните его, разрешите доступ к камере и обновите страницу. Чтобы обновить страницу, нажмите значок обновления «⟳» в адресной строке.",
    sr: "Loading...",
    es: 'Este estudio requiere el uso de la cámara web. Permitir el acceso a la cámara web es opcional, pero no podemos continuar sin él. Si respondió "No" por error y ahora desea permitir el acceso a su cámara, puede hacerlo. Primero, presione la tecla ESC para ver la barra de direcciones. Luego, busque el ícono de la cámara en la barra de direcciones, haga clic en él, permita el acceso a la cámara y actualice la página. Para actualizar la página, toque el ícono de actualización "⟳" en la barra de direcciones.',
