    "zh-TW":
      "參與本研究，您可以透過提供各種智慧型手機麥克風和電腦揚聲器的重要數據，為線上聽力研究的進步做出有意義的貢獻。本研究旨在創建一個詳細的設備配置文件庫，以提高線上聽力測試的準確性。此方案依賴將使用者的手機麥克風與實驗室校準的麥克風進行配對。每種型號的麥克風都不同，因此指定型號至關重要。\n我們理解隱私是我們的首要任務，請放心，本次調查僅保留手機和電腦的型號。這些型號不會關聯任何個人訊息，也不會識別您的身分。",
    hr: "Loading...",
    cs: "Účast v této studii vám umožní významně přispět k rozvoji online výzkumu sluchu poskytnutím základních údajů o rozmanité řadě mikrofonů chytrých telefonů a počítačových reproduktorů. Cílem tohoto výzkumu je vytvořit podrobnou knihovnu profilů zařízení, která zvýší přesnost testů sluchu prováděných online.  Schéma závisí na přizpůsobení mikrofonu telefonu uživatele k mikrofonu kalibrovanému v laboratoři. Každý model má jiný mikrofon, takže je důležité model specifikovat. \nChápete, že soukromí je prioritou, ujišťujeme vás, že tento průzkum uchovává pouze čísla modelů telefonů a počítačů. Tato čísla modelů nejsou spojena s žádnými osobními údaji a neidentifikují vás. ",
    da: "Loading...",
    nl: "Deelname aan dit onderzoek stelt u in staat een zinvolle bijdrage te leveren aan de vooruitgang van online gehooronderzoek door essentiële gegevens te verstrekken over de diverse smartphonemicrofoons en computerluidsprekers. Dit onderzoek is gericht op het creëren van een gedetailleerde bibliotheek met apparaatprofielen die de nauwkeurigheid van online gehoortesten zal verbeteren. Het programma is gebaseerd op het matchen van de telefoonmicrofoon van de gebruiker met een in het laboratorium gekalibreerde microfoon. Elk model heeft een andere microfoon, dus het is cruciaal om het model te specificeren.\nOmdat privacy een prioriteit is, kunt u erop vertrouwen dat deze enquête alleen de modelnummers van telefoons en computers bevat. Deze modelnummers zijn niet gekoppeld aan persoonlijke gegevens en identificeren u niet.",
    fi: "Loading...",
