    "zh-CN":
      "连接互联网\n您正在测试的手机是否已连接到互联网？\n1. 如果是，请点击下方的“确定”继续。\n2. 📶 蜂窝服务：如果手机的蜂窝服务已连接到互联网，请点击“确定”。\n3. 🛜 无线网络：通过 WLAN 将手机连接到互联网，然后点击“确定”。\n4. 📅 设置时间和日期：新手机或已重置的旧手机没有蜂窝服务账户且日期错误。设置时间和日期后，它将支持热点/网络共享，如下所述。\n5. 📱🔗📱热点：如果测试手机不是您的个人手机，并且您的个人手机已连接互联网，则两部手机可以共享互联网访问。通过 Wi-Fi、蓝牙或 USB 连接手机：\n* 📱🛜📱 Wi-Fi 热点：如果您的个人手机已通过蜂窝服务连接到互联网，则可以为测试手机提供 Wi-Fi 热点。连接后，请点击下方的“确定”。\n* 📱>ᛒ📱 蓝牙网络共享：如果您的个人手机使用 Wi-Fi 上网，则可以通过蓝牙共享互联网。在两部手机上启用蓝牙（iPhone 上）或蓝牙网络共享（安卓手机上），通过蓝牙配对，然后点击下方的“确定”。\n* 📱—📱 USB 网络共享：如果两部手机都是 iPhone 或安卓手机，它们可以通过 USB 数据线共享互联网，前提是您有合适的数据线。如今，大多数手机使用 USB-C 接口，但 iPhone 14 及更早的机型使用 Lightning 接口。使用合适的数据线连接手机，然后点击下方的“确定”。\n6. ❌ 没有互联网：如果这些选项都不可用，请先单击下面的“确定”，然后单击“❌ 所有连接尝试失败”。",
    "zh-TW":
      "連結網路\n您正在測試的手機是否已連接到網路？\n1. 如果是，請點選下方的「確定」繼續。\n2. 📶 蜂窩服務：如果手機的蜂窩服務已連接到互聯網，請點擊“確定”。\n3. 🛜 無線網路：透過 WLAN 將手機連接到互聯網，然後點選「確定」。\n4. 📅 設定時間和日期：新手機或已重設的舊手機沒有蜂窩服務帳戶且日期錯誤。設定時間和日期後，它將支援熱點/網路共享，如下所述。\n5. 📱🔗📱熱點：如果測試手機不是您的個人手機，並且您的個人手機已連接互聯網，則兩部手機可以共享互聯網訪問。透過 Wi-Fi、藍牙或 USB 連接手機：\n* 📱🛜📱 Wi-Fi 熱點：如果您的個人手機已透過蜂窩服務連接到互聯網，則可以為測試手機提供 Wi-Fi 熱點。連接後，請點選下方的「確定」。\n* 📱>ᛒ📱 藍牙網路共享：如果您的個人手機使用 Wi-Fi 上網，則可以透過藍牙共享網路。在兩部手機上啟用藍牙（iPhone 上）或藍牙網路共享（安卓手機上），透過藍牙配對，然後點擊下方的「確定」。\n* 📱—📱 USB 網路分享：如果兩部手機都是 iPhone 或安卓手機，它們可以透過 USB 線共享互聯網，前提是您有合適的線。如今，大多數手機使用 USB-C 接口，但 iPhone 14 及更早的機型使用 Lightning 接口。使用合適的數據線連接手機，然後點擊下方的「確定」。\n6. ❌ 沒有網路：如果這些選項都不可用，請先點擊下面的“確定”，然後按一下“❌ 所有連線嘗試失敗”。",
    hr: "POVEZIVANJE NA INTERNET\nJe li telefon koji testirate već spojen na internet?\n1. DA, zatim kliknite U redu ispod za nastavak.\n2. 📶 MOBILNA USLUGA: Ako se mobilna usluga telefona poveže s internetom, kliknite U redu.\n3. 🛜 WIFI: Povežite telefon s internetom putem Wi-Fi veze i kliknite OK.\n4. 📅 POSTAVITE VRIJEME I DATUM: novi telefon ili stari telefon koji je resetiran, nema račun mobilne usluge i pogrešan datum. Nakon što postavite vrijeme i datum, radit će s pristupnom točkom/tetheringom, kao što je objašnjeno u nastavku.\n5. 📱🔗📱HOTSPOT: Ako testni telefon nije vaš osobni telefon, a vaš osobni telefon ima internet, dva telefona mogu dijeliti pristup internetu. Povežite telefone jedan s drugim Wi-Fi, Bluetooth ili USB:\n    * 📱🛜📱 Wi-Fi pristupna točka: ako je vaš osobni telefon povezan s internetom putem mobilne usluge, može pružiti Wi-Fi pristupnu točku testnom telefonu. Nakon povezivanja kliknite U redu ispod.\n    * 📱>ᛒ📱 Bluetooth povezivanje: ako vaš osobni telefon koristi Wi-Fi za pristup internetu, može dijeliti pristup internetu putem Bluetootha. Omogućite Bluetooth (na iPhoneu) ili Bluetooth povezivanje (na Androidu) na oba telefona, uparite ih putem Bluetootha i kliknite U redu ispod.\n    * 📱—📱 USB Tethering: ako su oba telefona iPhone ili su oba Androida, mogu dijeliti pristup internetu putem USB kabela, pod uvjetom da imate odgovarajući kabel. Danas većina telefona koristi USB-C konektor, ali iPhone 14 i stariji koriste Lightning konektor. Povežite telefone odgovarajućim kabelom i kliknite OK ispod.\n6. ❌ NEMA INTERNETA: Ako nijedna od ovih opcija nije dostupna, prvo kliknite OK ispod, a zatim “❌ Svi pokušaji povezivanja nisu uspjeli”.",
    cs: "Loading...",
    da: "FORBINDELSE TIL INTERNET\nEr den telefon, du tester, allerede forbundet til internettet?\n1. JA, klik derefter på OK nedenfor for at fortsætte.\n2. 📶 CELLETJENESTE: Hvis telefonens mobiltjeneste opretter forbindelse til internettet, skal du klikke på OK.\n3. 🛜 WIFI: Tilslut telefonen til internettet via Wi-Fi, og klik på OK.\n4. 📅 INDSTIL TID OG DATO: En ny telefon eller en gammel telefon, der er blevet nulstillet, har ingen mobiltjenestekonto og den forkerte dato. Når du har indstillet tid og dato, fungerer det med hotspot/tethering, som forklaret næste.\n5. 📱🔗📱HOTSPOT: Hvis testtelefonen ikke er din personlige telefon, og din personlige telefon har internet, kan de to telefoner dele internetadgang. Forbind telefonerne til hinanden via Wi-Fi, Bluetooth eller USB:\n    * 📱🛜📱 Wi-Fi-hotspot: Hvis din personlige telefon er forbundet til internettet via mobiltjeneste, kan den give et Wi-Fi-hotspot til testtelefonen. Når du er tilsluttet, skal du klikke på OK nedenfor.\n    * 📱>ᛒ📱 Bluetooth-tethering: Hvis din personlige telefon bruger Wi-Fi til internetadgang, kan den dele internetadgangen via Bluetooth. Aktiver Bluetooth (på iPhone) eller Bluetooth-tethering (på Android) på begge telefoner, par dem via Bluetooth, og klik på OK nedenfor.\n    * 📱—📱 USB-tethering: Hvis begge telefoner er iPhones, eller begge telefoner er Androids, kan de dele internetadgangen via et USB-kabel, forudsat at du har det rigtige kabel. I dag bruger de fleste telefoner et USB-C-stik, men iPhone 14 og tidligere bruger Lightning-stikket. Tilslut telefonerne via det relevante kabel, og klik på OK nedenfor.\n6. ❌ INGEN INTERNET: Hvis ingen af ​​disse muligheder er tilgængelige, skal du først klikke på OK nedenfor og derefter på “❌ Alle forbindelsesforsøg mislykkedes”.",
