    ur: 'انٹرنیٹ سے منسلک ہو رہا ہے۔\nکیا آپ جس فون کی جانچ کر رہے ہیں وہ پہلے سے ہی انٹرنیٹ سے منسلک ہے؟\n1. ہاں، پھر آگے بڑھنے کے لیے نیچے OK پر کلک کریں۔\n2. 📶 سیل سروس: اگر فون کی سیل سروس انٹرنیٹ سے جڑ جاتی ہے، تو ٹھیک ہے پر کلک کریں۔\n3. 🛜 وائی فائی: وائی فائی کے ذریعے فون کو انٹرنیٹ سے جوڑیں اور ٹھیک ہے پر کلک کریں۔\n4. 📅 وقت اور تاریخ مقرر کریں: ایک نیا فون، یا ایک پرانا فون جسے دوبارہ ترتیب دیا گیا ہے، اس کا کوئی سیل سروس اکاؤنٹ نہیں ہے اور تاریخ غلط ہے۔ ایک بار جب آپ وقت اور تاریخ طے کر لیتے ہیں، تو یہ ہاٹ اسپاٹ/ٹیچرنگ کے ساتھ کام کرے گا، جیسا کہ آگے بتایا گیا ہے۔\n5. 📱🔗📱HOTSPOT: اگر ٹیسٹ فون آپ کا ذاتی فون نہیں ہے، اور آپ کے ذاتی فون میں انٹرنیٹ ہے، تو دونوں فون انٹرنیٹ تک رسائی کا اشتراک کر سکتے ہیں۔ وائی ​​فائی، بلوٹوتھ یا USB کے ذریعے فونز کو ایک دوسرے سے جوڑیں:\n    * 📱🛜📱 Wi-Fi ہاٹ اسپاٹ: اگر آپ کا ذاتی فون سیل سروس کے ذریعے انٹرنیٹ سے منسلک ہے، تو یہ ٹیسٹ فون کو Wi-Fi ہاٹ اسپاٹ فراہم کر سکتا ہے۔ ایک بار منسلک ہونے کے بعد، نیچے OK پر کلک کریں۔\n    * 📱>ᛒ📱 بلوٹوتھ ٹیتھرنگ: اگر آپ کا ذاتی فون انٹرنیٹ تک رسائی کے لیے وائی فائی استعمال کر رہا ہے، تو یہ بلوٹوتھ کے ذریعے انٹرنیٹ تک رسائی کا اشتراک کر سکتا ہے۔ دونوں فونز پر بلوٹوتھ (آئی فون پر) یا بلوٹوتھ ٹیتھرنگ (اینڈرائیڈ پر) کو فعال کریں، انہیں بلوٹوتھ کے ذریعے جوڑیں، اور نیچے اوکے پر کلک کریں۔\n    * 📱—📱 USB ٹیتھرنگ: اگر دونوں فونز iPhones ہیں یا دونوں فون Androids ہیں، تو وہ USB کیبل کے ذریعے انٹرنیٹ تک رسائی کا اشتراک کر سکتے ہیں، بشرطیکہ آپ کے پاس صحیح کیبل ہو۔ آج، زیادہ تر فونز USB-C کنیکٹر استعمال کرتے ہیں، لیکن iPhone 14 اور اس سے پہلے کے فون لائٹننگ کنیکٹر استعمال کرتے ہیں۔ فونز کو مناسب کیبل کے ذریعے جوڑیں اور نیچے OK پر کلک کریں۔\n6. ❌ کوئی انٹرنیٹ نہیں: اگر ان میں سے کوئی بھی آپشن دستیاب نہیں ہے، تو پہلے نیچے OK پر کلک کریں اور پھر "❌ کنکشن کی تمام کوششیں ناکام ہو گئیں"۔',
