    kn: 'ಇಲ್ಲದಿದ್ದರೆ:\n• ನಿಮ್ಮ ಕ್ಯಾಮರಾ QR ಕೋಡ್ ಅನ್ನು ಗುರುತಿಸದಿದ್ದರೆ, ನಕಲಿಸಿ\nxxx\nನಿಮ್ಮ ಫೋನ್ ಬ್ರೌಸರ್‌ನಲ್ಲಿ ಮತ್ತು ಬ್ರೌಸರ್‌ನ GO ಬಟನ್ ಟ್ಯಾಪ್ ಮಾಡಿ. ಈ ಪುಟವು ನಂತರ ಮುಂದುವರಿಯಬೇಕು.\n• ಇಲ್ಲದಿದ್ದರೆ, ನಂತರ LLL, ಮತ್ತು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.\n• ಅದು ವಿಫಲವಾದರೆ, "❌ ಎಲ್ಲಾ ಸಂಪರ್ಕದ ಪ್ರಯತ್ನಗಳು ವಿಫಲವಾಗಿವೆ" ಎಂಬ ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.\n• ನಿಮ್ಮ ಫೋನ್ ಅನ್ನು ಸಂಪರ್ಕಿಸದೆಯೇ ನೀವು ಭಾಗವಹಿಸಲು ಬಯಸಿದರೆ, PREFER NOT ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.\n• ಅಂತಿಮವಾಗಿ, ಯಾವುದೇ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಲಭ್ಯವಿಲ್ಲದಿದ್ದರೆ, NO SMARTPHONE ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.',
    ko: "그렇지 않은 경우:\n• 카메라가 QR 코드를 인식하지 못하는 경우,\nxxx\n를 휴대폰 브라우저에 복사하고 브라우저의 '이동' 버튼을 탭하세요. 그러면 이 페이지로 넘어갑니다.\n• 인식되지 않으면 LLL을 클릭하고 다시 시도하세요.\n• 그래도 인식되지 않으면 \"❌ 모든 연결 시도 실패\" 버튼을 클릭하세요.\n• 휴대폰을 연결하지 않고 참여하려면 '선호 안 함' 버튼을 클릭하세요.\n• 마지막으로, 휴대폰을 사용할 수 없는 경우 '스마트폰 없음'을 클릭하세요.",
    lt: "KITAIP:\n• Jei fotoaparatas neatpažįsta QR kodo, tiesiog nukopijuokite\nxxx\nį savo telefono naršyklę ir bakstelėkite naršyklės mygtuką EITI. Tada šis puslapis turėtų judėti pirmyn.\n• Jei ne, tada LLL ir bandykite dar kartą.\n• Jei tai nepavyks, spustelėkite mygtuką „❌ ALL CONNECTION TTEMPTS FILED“.\n• Jei norite dalyvauti neprisijungę telefono, spauskite mygtuką NEUŽTIKRINTI.\n• Galiausiai, jei nėra išmaniojo telefono, spustelėkite NO SMARTPHONE.",
    ms: 'SELAINNYA:\n• Jika kamera anda tidak mengenali kod QR, salin sahaja\nxxx\nke dalam penyemak imbas telefon anda dan ketik butang GO penyemak imbas. Halaman ini kemudiannya harus maju.\n• Jika tidak, maka LLL, dan cuba lagi.\n• Jika gagal, klik butang yang dipanggil "❌ SEMUA PERCUBAAN SAMBUNGAN GAGAL".\n• Jika anda ingin mengambil bahagian tanpa menyambungkan telefon anda, klik butang PREFER NOT.\n• Akhir sekali, jika tiada telefon pintar tersedia, klik NO SMARTPHONE.',
    ml: "Loading...",
    no: "Loading...",
    fa: 'در غیر این صورت:\n• اگر دوربین شما کد QR را تشخیص نمی دهد، فقط کپی کنید\nxxx\nوارد مرورگر گوشی خود شوید و روی دکمه GO مرورگر ضربه بزنید. سپس این صفحه باید پیشروی کند.\n• اگر نه، LLL، و دوباره امتحان کنید.\n• در صورت عدم موفقیت، روی دکمه "❌ ALL CONNECTION TTEMPTS FAILED" کلیک کنید.\n• اگر می خواهید بدون اتصال تلفن خود شرکت کنید، روی دکمه PREFER NOT کلیک کنید.\n• در نهایت، اگر گوشی هوشمندی در دسترس نیست، روی NO SMARTPHONE کلیک کنید.',
    pl: "Loading...",
