      "OTHERWISE:\nIf your camera doesn't recognize the QR code, just copy\nxxx\ninto your phone browser and tap the browser's GO button. This page should then advance.\nIf not, then LLL, and try again.\nFailing that, click the ALL CONNECTION ATTEMPTS FAILED button.\nFinally, if no smartphone is handy, click NO SMARTPHONE.",
    "en-US_1":
      "OTHERWISE:\nIf your camera doesn't recognize the QR code, just copy\nxxx\ninto your phone browser and tap the browser's GO button. This page should then advance.\nIf not, then LLL, and try again.\nFailing that, click the ALL CONNECTION ATTEMPTS FAILED button.\nFinally, if no smartphone is handy, click NO SMARTPHONE.",
    ar: 'خلاف ذلك:\nإذا لم تتعرف الكاميرا على رمز الاستجابة السريعة، فما عليك سوى نسخ xxx إلى متصفح هاتفك والنقر على زر "انتقال". ستنتقل هذه الصفحة بعد ذلك.\n\nإذا لم يحدث ذلك، فاضغط على LLL وحاول مرة أخرى.\n\nإذا لم ينجح ذلك، فانقر على زر "فشلت جميع محاولات الاتصال".\n\nوأخيرًا، إذا لم يكن لديك هاتف ذكي، فانقر على "لا يوجد هاتف ذكي".',
    hy: "Loading...",
