    "zh-CN":
      "否则：\n如果您的相机无法识别二维码，只需将\nxxx\n复制到手机浏览器中，然后点击浏览器的“前往”按钮。然后，此页面应该会继续前进。\n如果仍然无法识别，请点击“LLL”，然后重试。\n如果仍然无法识别，请点击“所有连接尝试均失败”按钮。\n最后，如果您手边没有智能手机，请点击“无智能手机”。",
    "zh-TW": "Loading...",
    hr: "INAČE:\nAko vaša kamera ne prepoznaje QR kod, samo kopirajte\nxxx\nu preglednik telefona i dodirnite gumb KRENI preglednika. Ova bi stranica tada trebala napredovati.\nAko ne, onda LLL, i pokušaj ponovno.\nAko to ne uspije, kliknite gumb SVI POKUŠAJI POVEZIVANJA NEUSPJELI.\nNa kraju, ako nijedan pametni telefon nije pri ruci, kliknite NEMA PAMETNOG TELEFONA.",
    cs: "Loading...",
    da: "ELLERS:\nHvis dit kamera ikke genkender QR-koden, skal du bare kopiere\nxxx\nind i din telefons browser og tryk på browserens GO-knap. Denne side bør derefter gå videre.\nHvis ikke, så LLL, og prøv igen.\nHvis det mislykkes, skal du klikke på knappen ALLE FORBINDELSESFORSØG MISLYKKES.\nTil sidst, hvis der ikke er nogen smartphone ved hånden, skal du klikke på INGEN SMARTPHONE.",
    nl: "Loading...",
    fi: "Loading...",
    fr: "Loading...",
    de: "Loading...",
    el: "ΑΛΛΙΩΣ:\nΕάν η κάμερά σας δεν αναγνωρίζει τον κωδικό QR, απλώς αντιγράψτε\nxxx\nστο πρόγραμμα περιήγησης του τηλεφώνου σας και πατήστε το κουμπί GO του προγράμματος περιήγησης. Αυτή η σελίδα θα πρέπει στη συνέχεια να προχωρήσει.\nΕάν όχι, τότε LLL και δοκιμάστε ξανά.\nΣε αντίθετη περίπτωση, κάντε κλικ στο κουμπί ΟΛΕΣ ΟΙ ΠΡΟΣΠΑΘΕΙΕΣ ΣΥΝΔΕΣΗΣ ΑΠΟΤΥΧΙΣΑΝ.\nΤέλος, εάν κανένα smartphone δεν είναι βολικό, κάντε κλικ στο NO SMARTPHONE.",
    he: "אַחֶרֶת:\nאם המצלמה שלך לא מזהה את קוד ה-QR, פשוט העתק\nxxx\nלתוך דפדפן הטלפון שלך והקש על לחצן GO של הדפדפן. לאחר מכן, הדף הזה אמור להתקדם.\nאם לא, אז LLL, ונסה שוב.\nאם זה נכשל, לחץ על הלחצן כל ניסיונות החיבור נכשלו.\nלבסוף, אם אין סמארטפון בהישג יד, לחץ על אין טלפון חכם.",
    hi: "अन्यथा:\nअगर आपका कैमरा QR कोड को नहीं पहचानता है, तो बस\nxxx\nको अपने फ़ोन ब्राउज़र में कॉपी करें और ब्राउज़र के GO बटन पर टैप करें। यह पेज आगे बढ़ जाना चाहिए।\nअगर नहीं, तो LLL करें और फिर से कोशिश करें।\nअगर ऐसा नहीं होता है, तो ALL CONNECTION ATTEMPTS FAILED बटन पर क्लिक करें।\nआखिर में, अगर कोई स्मार्टफ़ोन उपलब्ध नहीं है, तो NO SMARTPHONE पर क्लिक करें।",
    hu: "EGYÉBKÉNT:\nHa a fényképezőgép nem ismeri fel a QR-kódot, egyszerűen másolja\nxxx\nlépjen be a telefon böngészőjébe, és érintse meg a böngésző GO gombját. Ennek az oldalnak ezután előre kell lépnie.\nHa nem, akkor LLL, és próbálja újra.\nHa ez nem sikerül, kattintson az ALL CONNECTION TTEMPTS FAILED gombra.\nVégül, ha nincs kéznél okostelefon, kattintson a NO SMARTPHONE elemre.",
