    ko: "그렇지 않은 경우:\n카메라가 QR 코드를 인식하지 못하는 경우,\nxxx\n를 휴대폰 브라우저에 복사하고 브라우저의 '이동' 버튼을 누르세요. 그러면 이 페이지로 넘어갈 것입니다.\n인식되지 않으면 'LLL'을 클릭하고 다시 시도하세요.\n그래도 인식되지 않으면 '모든 연결 시도 실패' 버튼을 클릭하세요.\n마지막으로, 스마트폰이 없으면 '스마트폰 없음'을 클릭하세요.",
