    fa: "در غیر این صورت:\nاگر دوربین شما کد QR را نمی شناسد، فقط کپی کنید\nxxx\nوارد مرورگر گوشی خود شوید و روی دکمه GO مرورگر ضربه بزنید. سپس این صفحه باید پیشروی کند.\nاگر نه، پس LLL، و دوباره امتحان کنید.\nدر صورت عدم موفقیت، روی دکمه ALL CONNECTION TTEMPTS FAILED کلیک کنید.\nدر نهایت، اگر گوشی هوشمندی در دسترس نیست، روی NO SMARTPHONE کلیک کنید.",
    pl: "W INACZEJ:\nJeśli aparat nie rozpoznaje kodu QR, po prostu skopiuj\nxxx\ndo przeglądarki telefonu i naciśnij przycisk GO w przeglądarce. Ta strona powinna przejść dalej.\nJeśli nie, naciśnij LLL i spróbuj ponownie.\nJeśli to się nie powiedzie, kliknij przycisk ALL CONNECTION ATTEMPTS FAILED (WSZYSTKIE PRÓBY POŁĄCZENIA NIEUDANE).\nNa koniec, jeśli nie masz pod ręką smartfona, kliknij NO SMARTPHONE (BRAK SMARTFONA).",
    pt: "Loading...",
    ro: "ALTFEL:\nDacă camera nu recunoaște codul QR, doar copiați\nxxx\nîn browserul telefonului și atingeți butonul GO al browserului. Această pagină ar trebui apoi să avanseze.\nDacă nu, atunci LLL și încercați din nou.\nÎn caz contrar, faceți clic pe butonul TOATE ÎNCERCĂRI DE CONEXIUNE EȘUATE.\nÎn cele din urmă, dacă niciun smartphone nu este la îndemână, faceți clic pe NU SMARTPHONE.",
