    nl: "Sorry, de QR-code is niet weergegeven. Vernieuw de pagina voor een nieuwe poging. Om de pagina te vernieuwen, tikt u op het vernieuwingspictogram ⟳ in de adresbalk. Als het probleem aanhoudt, drukt u hieronder op de knop KAN GEEN VERBINDING MAKEN VIA QR-CODE.",
    fi: "Loading...",
    fr: "Désolé, le code QR n'apparaît pas. Veuillez actualiser la page pour réessayer. Pour actualiser la page, appuyez sur l'icône d'actualisation ⟳ dans la barre d'adresse. Si le problème persiste, cliquez sur le bouton « CONNEXION PAR CODE QR » ci-dessous.",
    de: "Der QR-Code konnte leider nicht angezeigt werden. Aktualisieren Sie die Seite für einen weiteren Versuch. Tippen Sie dazu auf das Aktualisierungssymbol ⟳ in der Adressleiste. Sollte das Problem weiterhin bestehen, klicken Sie unten auf die Schaltfläche „Verbindung per QR-Code nicht möglich“.",
    el: "Λυπούμαστε, ο κωδικός QR απέτυχε να εμφανιστεί. Ανανεώστε τη σελίδα για άλλη μια προσπάθεια. Για να ανανεώσετε τη σελίδα, πατήστε το εικονίδιο ανανέωσης ⟳ στη γραμμή διευθύνσεων. Εάν το πρόβλημα παραμένει, πατήστε το κουμπί CAN'T CONNECT VIA QR CODE παρακάτω.",
    he: "Loading...",
