    hu: "Sajnáljuk, a QR-kód nem jelent meg. Újabb próbálkozáshoz frissítse az oldalt. Az oldal frissítéséhez érintse meg a frissítés ikont ⟳ a címsorban. Ha a probléma továbbra is fennáll, nyomja meg a NEM LEHET KAPCSOLATOT A QR-KÓDON KÍVÜL gombot alább.",
    is: "Því miður birtist QR-kóði ekki. Endurnýjaðu síðuna fyrir aðra tilraun. Til að endurnýja síðuna, ýttu á endurnýjunartáknið ⟳ á veffangastikunni. Ef vandamálið er viðvarandi skaltu ýta á CAN'T CONNECT VIA QR CODE hnappinn hér að neðan.",
    id: "Loading...",
    it: "Spiacenti, il codice QR non è apparso. Aggiorna la pagina per un altro tentativo. Per aggiornare la pagina, tocca l'icona di aggiornamento ⟳ nella barra degli indirizzi. Se il problema persiste, premi il pulsante IMPOSSIBILE CONNETTERSI TRAMITE CODICE QR qui sotto.",
