    no: "Loading...",
    fa: "Loading...",
    pl: "Przepraszamy, kod QR nie pojawił się. Odśwież stronę, aby spróbować ponownie. Aby odświeżyć stronę, dotknij ikony odświeżania ⟳ na pasku adresu. Jeśli problem będzie się powtarzał, naciśnij przycisk NIE MOŻNA POŁĄCZYĆ SIĘ PRZEZ KOD QR poniżej.",
    pt: "Loading...",
    ro: "Ne pare rău, codul QR nu a apărut. Actualizați pagina pentru o altă încercare. Pentru a reîmprospăta pagina, atingeți pictograma de reîmprospătare ⟳ din bara de adrese. Dacă problema persistă, apăsați butonul NU POATE CONECTA PRIN COD QR de mai jos.",
    ru: "Извините, QR-код не отобразился. Обновите страницу для еще одной попытки. Чтобы обновить страницу, нажмите значок обновления ⟳ в адресной строке. Если проблема не устранена, нажмите кнопку НЕ МОЖЕТ БЫТЬ ПОДКЛЮЧЕН ЧЕРЕЗ QR-КОД ниже.",
    sr: "Жао нам је, КР код се није појавио. Освежите страницу за још један покушај. Да бисте освежили страницу, додирните икону за освежавање ⟳ у траци за адресу. Ако проблем и даље постоји, притисните дугме НЕ МОГУ СЕ ПОВЕЗИВАТИ ПРЕКО КР КОДА.",
    es: 'Lo sentimos, el código QR no se pudo mostrar. Actualice la página para intentarlo de nuevo. Para actualizar la página, toque el icono de actualización ⟳ en la barra de direcciones. Si el problema persiste, presione el botón "NO SE PUEDE CONECTAR MEDIANTE CÓDIGO QR" que aparece a continuación.',
    sw: "Samahani, msimbo wa QR umeshindwa kuonekana. Onyesha upya ukurasa kwa jaribio lingine. Ili kuonyesha upya ukurasa, gusa aikoni ya kuonyesha upya ⟳ katika upau wa anwani. Tatizo likiendelea, bonyeza kitufe cha CAN'T CONNECT KUPITIA MSIMBO WA QR hapa chini.",
