    he: "צור פלטפורמה\nאנחנו צריכים פלטפורמה מוגבהת (משטח ישר) כדי להניח עליה את הטלפון שלך. פלטפורמה זו יכולה להיות זכוכית, ספל, צנצנת, פחית, קופסה או ערימת ספרים.\n\nהצב את הפלטפורמה\n1. אם אתה משתמש במחשב נייד עם רמקולים מובנים במקלדת, הנח את הפלטפורמה שלך על השולחן בינך לבין המחשב שלך, ליד המקלדת.\n\n2. אם למחשב שלך יש רמקולים הממוקמים במקום אחר, הנח את הפלטפורמה שלך על השולחן בינך לבין הרמקולים כך שהקצה הרחוק של הטלפון בפלטפורמה שלך יהיה באמצע הדרך בין הרמקולים לעיניים שלך כשאתה משתמש במחשב.\n\nהתאם את גובה הפלטפורמה\nאתה יכול לערום פריטים, כמו ספרים וכוס, כדי להגיע לגובה הנכון. הפוך את הפלטפורמה שלך גבוהה מספיק כך שהיא תהיה בינונית בגובה בין הרמקולים והיכן שהעיניים שלך נמצאות כשאתה יושב ליד השולחן באמצעות המחשב שלך.\n\nמוּכָן?\nכאשר הפלטפורמה שלך מוכנה, לחץ על RETURN או לחץ על המשך כדי להמשיך.",
    hi: "एक प्लेटफ़ॉर्म बनाएँ\nहमें आपके फ़ोन को रखने के लिए एक उठा हुआ प्लेटफ़ॉर्म (एक समतल सतह) चाहिए। यह प्लेटफ़ॉर्म एक गिलास, मग, जार, कैन, बॉक्स या किताबों का ढेर हो सकता है।\n\nप्लेटफ़ॉर्म रखें\n1. अगर आप कीबोर्ड में स्पीकर वाले लैपटॉप का इस्तेमाल कर रहे हैं, तो अपने प्लेटफ़ॉर्म को कीबोर्ड के पास अपने और अपने कंप्यूटर के बीच टेबल पर रखें।\n\n2. अगर आपके कंप्यूटर में स्पीकर कहीं और लगे हैं, तो अपने प्लेटफ़ॉर्म को अपने और स्पीकर के बीच टेबल पर रखें ताकि जब आप अपने कंप्यूटर का इस्तेमाल कर रहे हों, तो आपके प्लेटफ़ॉर्म पर फ़ोन का दूर वाला सिरा स्पीकर और आपकी आँखों के बीच में हो।\n\nप्लेटफ़ॉर्म की ऊँचाई समायोजित करें\nआप सही ऊँचाई तक पहुँचने के लिए किताबें और गिलास जैसी वस्तुओं को एक साथ रख सकते हैं। अपने प्लेटफ़ॉर्म को इतना ऊँचा बनाएँ कि जब आप टेबल पर बैठकर अपने कंप्यूटर का इस्तेमाल कर रहे हों, तो यह स्पीकर और आपकी आँखों के बीच की ऊँचाई में बीच में हो।\n\nतैयार हैं?\nजब आपका प्लेटफ़ॉर्म तैयार हो जाए, तो RETURN दबाएँ या जारी रखने के लिए PROCEED पर क्लिक करें।",
