    tl: "GUMAWA NG PLATFORM\nKailangan namin ng nakataas na platform (isang patag na ibabaw) para i-rest ang iyong telepono. Ang platform na ito ay maaaring isang baso, mug, garapon, lata, kahon, o isang stack ng mga libro.\n\nILAGAY ANG PLATFORM\n1. Kung gumagamit ka ng laptop na may mga speaker na nakapaloob sa keyboard, ilagay ang iyong platform sa mesa sa pagitan mo at ng iyong computer, malapit sa keyboard.\n\n2. Kung ang iyong computer ay may mga speaker na matatagpuan sa ibang lugar, ilagay ang iyong platform sa mesa sa pagitan mo at ng mga speaker upang ang dulong bahagi ng telepono sa iyong platform ay nasa pagitan ng mga speaker at iyong mga mata kapag ginagamit mo ang iyong computer.\n\nISAYOS ANG TAAS NG PLATFORM\nMaaari kang mag-stack ng mga item, tulad ng mga libro at baso, upang maabot ang tamang taas. Gawing sapat ang taas ng iyong platform upang ito ay katamtaman ang taas sa pagitan ng mga speaker at kung nasaan ang iyong mga mata kapag nakaupo ka sa mesa gamit ang iyong computer.\n\nHANDA?\nKapag handa na ang iyong platform, pindutin ang RETURN o i-click ang PROCEED para magpatuloy.",
    tr: "Loading...",
    ur: "ایک پلیٹ فارم بنائیں\nآپ کے فون کو آرام دینے کے لیے ہمیں ایک بلند پلیٹ فارم (ایک سطح کی سطح) کی ضرورت ہے۔ یہ پلیٹ فارم شیشہ، پیالا، جار، ڈبہ، ڈبہ یا کتابوں کا ڈھیر ہو سکتا ہے۔\n\nپلیٹ فارم رکھیں\n1. اگر آپ کی بورڈ میں بنائے گئے اسپیکر کے ساتھ لیپ ٹاپ استعمال کر رہے ہیں، تو اپنے پلیٹ فارم کو اپنے اور اپنے کمپیوٹر کے درمیان میز پر، کی بورڈ کے قریب رکھیں۔\n\n2. اگر آپ کے کمپیوٹر میں اسپیکر کہیں اور موجود ہیں، تو اپنے پلیٹ فارم کو اپنے اور اسپیکر کے درمیان ٹیبل پر رکھیں تاکہ جب آپ اپنا کمپیوٹر استعمال کر رہے ہوں تو آپ کے پلیٹ فارم پر فون کا آخری حصہ اسپیکرز اور آپ کی آنکھوں کے درمیان آدھا رہ جائے۔\n\nپلیٹ فارم کی اونچائی کو ایڈجسٹ کریں۔\nآپ صحیح اونچائی تک پہنچنے کے لیے کتابیں اور شیشہ جیسی اشیاء کو اسٹیک کر سکتے ہیں۔ اپنے پلیٹ فارم کو کافی لمبا بنائیں تاکہ یہ اسپیکر کے درمیان اونچائی میں درمیانی ہو اور جب آپ اپنے کمپیوٹر کا استعمال کرتے ہوئے میز پر بیٹھے ہوں تو آپ کی آنکھیں کہاں ہوتی ہیں۔\n\nتیار ہیں؟\nجب آپ کا پلیٹ فارم تیار ہو جائے تو RETURN دبائیں یا جاری رکھنے کے لیے آگے بڑھیں پر کلک کریں۔",
