    fr: "showMeasuredSoundLevelBool est VRAI dans une ou plusieurs conditions ; un microphone est donc nécessaire pour effectuer ces mesures.\n1. CONNECTEZ votre microphone miniDSP UMIK-1 ou 2 à cet ordinateur.\n2. SÉLECTIONNEZ ce microphone dans la fenêtre contextuelle d'entrée audio ci-dessous.\n3. SÉLECTIONNEZ le modèle du microphone, UMIK-1 ou 2.\n4. Saisissez le numéro de série et cliquez sur le bouton RÉCUPÉRER LE PROFIL.\n5. CONFIGURER LE MICROPHONE\n\na. Écartez les trois pieds du trépied au maximum.\n\nb. Le clip du microphone du trépied est pivotant. Faites pivoter le clip jusqu'au côté qui place le bord le plus haut du clip plus haut.\n\nc. Insérez le microphone dans le clip du trépied, par le bas, jusqu'à ce que son extrémité inférieure soit alignée avec le bord le plus bas du clip.\n\nd. Ajustez l'inclinaison pour que le microphone soit vertical, pointant vers le plafond. e. Placez le trépied sur la table entre vous et votre ordinateur. Faites-le pivoter pour amener le microphone à vos côtés.\n  f. Poussez le trépied vers votre ordinateur (ou tout autre appareil équipé de haut-parleurs) jusqu'à ce que ses deux pieds les plus éloignés le touchent presque et que le troisième pied soit près de vous.\n6. AUTORISER L'UTILISATION DU MICROPHONE. Si une fenêtre contextuelle vous demande l'autorisation d'utiliser le microphone, cliquez sur « Autoriser ».\n7. ⇧🔊 VOLUME MAXIMUM. Pour une mesure précise du son, veuillez maximiser le volume de votre ordinateur maintenant, puis ne le touchez plus jusqu'à la fin de la session.\n8. Cliquez sur CONTINUER ou appuyez sur RETOUR.",
