    is: "Loading...",
    id: 'showMeasuredSoundLevelBool bernilai TRUE dalam satu atau beberapa kondisi, jadi mikrofon diperlukan untuk melakukan pengukuran tersebut.\n1. HUBUNGKAN mikrofon miniDSP UMIK-1 atau 2 Anda ke komputer ini.\n2. PILIH mikrofon tersebut pada pop-up masukan suara di bawah.\n3. PILIH nama model mikrofon, UMIK-1 atau 2.\n4. Masukkan nomor SERIAL, dan klik tombol FETCH PROFILE.\n5. SET UP MICROPHONE\n a. Rentangkan ketiga kaki tripod sejauh mungkin. \n  b. Klip mikrofon tripod berada pada poros putar. Putar klip sepenuhnya ke sisi mana pun yang membuat tepi klip tertinggi lebih tinggi. \n  c. Masukkan mikrofon ke dalam klip tripod, dari bawah, hingga ujung bawah mikrofon sejajar dengan tepi klip terendah. \n  d. Sesuaikan kemiringan untuk membuat mikrofon vertikal, mengarah ke langit-langit. \n  e. Letakkan tripod di atas meja di antara Anda dan komputer. Putar tripod untuk mendekatkan mikrofon ke samping Anda. \n  f. Dorong tripod ke arah komputer (atau apa pun yang memiliki speaker) hingga kedua kaki tripod yang jauh hampir menyentuhnya, dan kaki ketiga berada di dekat Anda.\n6. IZINKAN PENGGUNAAN MIKROFON. Jika muncul pop-up yang meminta izin untuk menggunakan mikrofon, klik "Izinkan".\n7. ⇧🔊 VOLUME MAKSIMAL. Untuk pengukuran suara yang akurat, maksimalkan volume suara komputer Anda sekarang, lalu jangan sentuh volume hingga sesi berakhir.\n8. Klik LANJUTKAN atau tekan RETURN.',
    it: "Loading...",
    ja: "showMeasuredSoundLevelBool が 1 つ以上の条件で TRUE になっているため、これらの測定にはマイクが必要です。\n1. miniDSP UMIK-1 または 2 マイクをこのコンピューターに接続します。\n2. 下のサウンド入力ポップアップでそのマイクを選択します。\n3. マイクのモデル名（UMIK-1 または 2）を選択します。\n4. シリアル番号を入力し、「FETCH PROFILE」ボタンをクリックします。\n5. マイクのセットアップ\n a. 三脚の 3 本の脚を最大まで広げます。\n  b. 三脚のマイククリップは回転します。クリップの一番高い端が高くなる側にクリップをいっぱいに回転させます。\n  c. マイクの下端がクリップの一番低い端と面一になるまで、マイクを下から三脚クリップに挿入します。\n  d. マイクが垂直になり、天井を向くように傾きを調整します。\n  e.三脚を、あなたとコンピューターの間のテーブルに置きます。三脚を回転させて、マイクがあなたの側に来るようにします。\n  f. 三脚の遠い方の2本の脚がコンピューター（またはスピーカー付きの機器）にほぼ触れ、3本目の脚があなたの近くに来るまで、三脚をコンピューター（またはスピーカー付きの機器）に押し込みます。\n6. マイクの使用を許可します。マイクの使用許可を求めるポップアップが表示されたら、「許可」をクリックします。\n7. ⇧🔊 最大音量。正確な音響測定を行うために、コンピューターの音量を最大にし、セッションが終了するまで音量を調整しないでください。\n8. 「続行」をクリックするか、Enterキーを押します。",
    kn: 'showMeasuredSoundLevelBool ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಪರಿಸ್ಥಿತಿಗಳಲ್ಲಿ ನಿಜವಾಗಿದೆ, ಆದ್ದರಿಂದ ಆ ಅಳತೆಗಳನ್ನು ಮಾಡಲು ಮೈಕ್ರೊಫೋನ್ ಅಗತ್ಯವಿದೆ.\n1. ನಿಮ್ಮ miniDSP UMIK-1 ಅಥವಾ 2 ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಈ ಕಂಪ್ಯೂಟರ್‌ಗೆ ಸಂಪರ್ಕಿಸಿ.\n2. ಕೆಳಗಿನ ಧ್ವನಿ ಇನ್‌ಪುಟ್ ಪಾಪ್-ಅಪ್‌ನಲ್ಲಿ ಆ ಮೈಕ್ರೊಫೋನ್ ಆಯ್ಕೆಮಾಡಿ.\n3. ಮೈಕ್ರೊಫೋನ್ ಮಾದರಿಯ ಹೆಸರನ್ನು ಆಯ್ಕೆ ಮಾಡಿ, UMIK-1 ಅಥವಾ 2.\n4. SERIAL ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ, ಮತ್ತು FETCH PROFILE ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.\n5. ಮೈಕ್ರೊಫೋನ್ ಹೊಂದಿಸಿ\n ಎ. ಮೂರು ಟ್ರೈಪಾಡ್ ಕಾಲುಗಳನ್ನು ಅವರು ಹೋಗುವಷ್ಟು ಹರಡಿ. \n ಬಿ. ಟ್ರೈಪಾಡ್‌ನ ಮೈಕ್ರೊಫೋನ್ ಕ್ಲಿಪ್ ಸ್ವಿವೆಲ್‌ನಲ್ಲಿದೆ. ಕ್ಲಿಪ್‌ನ ಅತ್ಯುನ್ನತ ಅಂಚನ್ನು ಯಾವ ಬದಿಗೆ ಹೆಚ್ಚಿಸುತ್ತದೋ ಆ ಕಡೆಗೆ ಕ್ಲಿಪ್ ಅನ್ನು ತಿರುಗಿಸಿ. \n ಸಿ. ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಟ್ರೈಪಾಡ್ ಕ್ಲಿಪ್‌ಗೆ ಕೆಳಗಿನಿಂದ ಸೇರಿಸಿ, ಮೈಕ್ರೊಫೋನ್‌ನ ಕೆಳಭಾಗದ ತುದಿಯು ಕ್ಲಿಪ್‌ನ ಕೆಳ ಅಂಚಿನೊಂದಿಗೆ ಫ್ಲಶ್ ಆಗುವವರೆಗೆ. \n ಡಿ. ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಲಂಬವಾಗಿ ಮಾಡಲು ಟಿಲ್ಟ್ ಅನ್ನು ಹೊಂದಿಸಿ, ಮೇಲ್ಛಾವಣಿಯ ಕಡೆಗೆ ತೋರಿಸುತ್ತದೆ. \n ಇ. ನಿಮ್ಮ ಮತ್ತು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ನಡುವಿನ ಮೇಜಿನ ಮೇಲೆ ಟ್ರೈಪಾಡ್ ಅನ್ನು ಇರಿಸಿ. ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ನಿಮ್ಮ ಬದಿಗೆ ತರಲು ಟ್ರೈಪಾಡ್ ಅನ್ನು ತಿರುಗಿಸಿ. \n f. ಟ್ರೈಪಾಡ್‌ನ ದೂರದ ಎರಡು ಕಾಲುಗಳು ಅದನ್ನು ಸ್ಪರ್ಶಿಸುವವರೆಗೆ ಮತ್ತು ಮೂರನೇ ಕಾಲು ನಿಮ್ಮ ಬಳಿ ಇರುವವರೆಗೆ ಟ್ರೈಪಾಡ್ ಅನ್ನು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ಗೆ (ಅಥವಾ ಸ್ಪೀಕರ್‌ಗಳನ್ನು ಹೊಂದಿರುವ ಯಾವುದಾದರೂ) ಕಡೆಗೆ ತಳ್ಳಿರಿ.\n6. ಮೈಕ್ರೊಫೋನ್ ಬಳಕೆಯನ್ನು ಅನುಮತಿಸಿ. ಮೈಕ್ರೊಫೋನ್ ಬಳಸಲು ಪಾಪ್ ಅಪ್ ಅನುಮತಿ ಕೇಳಿದರೆ, "ಅನುಮತಿಸು" ಕ್ಲಿಕ್ ಮಾಡಿ.\n7. ⇧🔊 ಗರಿಷ್ಠ ಸಂಪುಟ. ನಿಖರವಾದ ಧ್ವನಿ ಮಾಪನಕ್ಕಾಗಿ, ದಯವಿಟ್ಟು ಈಗ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನ ಧ್ವನಿಯ ಪರಿಮಾಣವನ್ನು ಹೆಚ್ಚಿಸಿ ಮತ್ತು ನಂತರ ಸೆಷನ್ ಮುಗಿಯುವವರೆಗೆ ವಾಲ್ಯೂಮ್ ಅನ್ನು ಸ್ಪರ್ಶಿಸಬೇಡಿ.\n8. ಮುಂದುವರೆಯಿರಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಅಥವಾ ರಿಟರ್ನ್ ಒತ್ತಿರಿ.',
