    pt: 'showMeasuredSoundLevelBool é TRUE em uma ou mais condições, portanto, um microfone é necessário para realizar essas medições.\n1. CONECTE seu microfone miniDSP UMIK-1 ou 2 a este computador.\n2. SELECIONE o microfone na janela pop-up de entrada de som abaixo.\n3. SELECIONE o nome do modelo do microfone, UMIK-1 ou 2.\n4. Digite o número de série e clique no botão FETCH PROFILE.\n5. CONFIGURE O MICROFONE\n a. Abra as três pernas do tripé o máximo possível.\n  b. O clipe do microfone do tripé está em um suporte giratório. Gire o clipe totalmente para o lado que deixar a borda mais alta do clipe mais alta.\n  c. Insira o microfone no clipe do tripé, de baixo para cima, até que a extremidade inferior do microfone esteja alinhada com a borda mais baixa do clipe.\n  d. Ajuste a inclinação para deixar o microfone na vertical, apontando para o teto.\n  e. Coloque o tripé sobre a mesa, entre você e o computador. Gire o tripé para trazer o microfone para o seu lado.\n  f. Empurre o tripé em direção ao computador (ou a qualquer lugar com alto-falantes) até que as duas pernas mais distantes do tripé quase o toquem e a terceira perna fique próxima de você.\n6. PERMITA O USO DO MICROFONE. Se uma janela pop-up solicitar permissão para usar o microfone, clique em "Permitir".\n7. ⇧🔊 VOLUME MÁXIMO. Para uma medição precisa do som, maximize o volume do seu computador agora e não toque no volume até o término da sessão.\n8. Clique em PROSSEGUIR ou pressione RETURN.',
    ro: "Loading...",
    ru: "showMeasuredSoundLevelBool имеет значение TRUE в одном или нескольких условиях, поэтому для проведения этих измерений необходим микрофон.\n1. ПОДКЛЮЧИТЕ микрофон miniDSP UMIK-1 или 2 к этому компьютеру.\n2. ВЫБЕРИТЕ этот микрофон во всплывающем окне ввода звука ниже.\n3. ВЫБЕРИТЕ название модели микрофона, UMIK-1 или 2.\n4. Введите СЕРИЙНЫЙ номер и нажмите кнопку FETCH PROFILE.\n5. НАСТРОЙКА МИКРОФОНА\n a. Раздвиньте три ножки штатива как можно дальше. \n  b. Зажим микрофона штатива имеет шарнирное соединение. Поверните зажим до упора в ту сторону, где самый высокий край зажима окажется выше. \n  c. Вставьте микрофон в зажим штатива снизу, пока нижний конец микрофона не совпадет с самым низким краем зажима. \n  d. Отрегулируйте наклон так, чтобы микрофон был вертикальным и направленным вверх к потолку. \n  д. Поставьте штатив на стол между вами и компьютером. Поверните штатив, чтобы микрофон оказался сбоку. \n  е. Придвиньте штатив к компьютеру (или к устройству с динамиками) так, чтобы две дальние ножки штатива почти коснулись его, а третья ножка оказалась рядом с вами.\n6. РАЗРЕШИТЕ ​​ИСПОЛЬЗОВАНИЕ МИКРОФОНА. Если всплывающее окно запрашивает разрешение на использование микрофона, нажмите «Разрешить».\n7. ⇧🔊 МАКСИМАЛЬНАЯ ГРОМКОСТЬ. Для точного измерения звука увеличьте громкость звука вашего компьютера сейчас, а затем не трогайте громкость до окончания сеанса.\n8. Нажмите ПРОДОЛЖИТЬ или нажмите RETURN.",
    sr: "Loading...",
    es: "Loading...",
    sw: 'showMeasuredSoundLevelBool ni TRUE katika hali moja au zaidi, kwa hivyo maikrofoni inahitajika ili kufanya vipimo hivyo.\n1. UNGANISHA maikrofoni yako ya miniDSP UMIK-1 au 2 kwenye kompyuta hii.\n2. CHAGUA maikrofoni hiyo kwenye kiibukizi cha ingizo la sauti hapa chini.\n3. CHAGUA jina la muundo wa maikrofoni, UMIK-1 au 2.\n4. Ingiza nambari ya SERIAL, na ubofye kitufe cha GETCH PROFILE.\n5. WEKA MICROPHONE\n a. Kueneza miguu mitatu ya tripod mbali kama wao kwenda. \n b. Klipu ya maikrofoni ya tripod iko kwenye mzunguko. Sogeza klipu hadi upande wowote hufanya makali ya juu zaidi ya klipu kuwa juu. \n c. Ingiza maikrofoni kwenye klipu ya tripod, kutoka chini, hadi mwisho wa maikrofoni uwe laini na ukingo wa chini kabisa wa klipu. \n d. Rekebisha kuinamisha ili kufanya maikrofoni iwe wima, ikielekeza juu ya dari. \n e. Weka tripod kwenye meza kati yako na kompyuta yako. Zungusha tripod ili kuleta maikrofoni upande wako. \n f. Sukuma tripod kuelekea kompyuta yako (au chochote kilicho na spika) hadi miguu miwili ya mbali ya tripod ikaribie kuigusa, na mguu wa tatu uwe karibu nawe.\n6. RUHUSU MATUMIZI YA MICROPHONE. Iwapo dirisha ibukizi litaomba ruhusa ya kutumia maikrofoni, bofya "Ruhusu".\n7. ⇧🔊 MAX VOLUME. Kwa kipimo sahihi cha sauti, tafadhali ongeza sauti ya kompyuta yako sasa, kisha usiguse sauti hadi kipindi kiishe.\n8. Bonyeza PROCEED au bonyeza RETURN.',
