    hi: "हम आपकी आँखों के बीच की दूरी मापेंगे। अपनी आँखों को देखने के लिए वीडियो इमेज का उपयोग करें। अपनी आँखों के सामने अपने चेहरे पर एक पेन को क्षैतिज रूप से पकड़ें। अपने दाएँ और बाएँ अंगूठे के नाखूनों को अपने दाएँ और बाएँ पुतलियों के केंद्र के साथ संरेखित करें। फिर अपने अंगूठों के बीच की दूरी मापने के लिए पेन को ऑन-स्क्रीन रूलर पर लाएँ। अपने बाएँ अंगूठे को शून्य के साथ संरेखित करें और ध्यान दें कि आपका दायाँ अंगूठा कहाँ है। पेन को नीचे रखें और उस बिंदु पर रूलर पर क्लिक करें। अंत में, जारी रखने के लिए ओके पर क्लिक करें।",
