    ja: "Loading...",
    kn: "ನಿಮ್ಮ ಕಣ್ಣುಗಳ ನಡುವಿನ ಅಂತರವನ್ನು ನಾವು ಅಳೆಯುತ್ತೇವೆ. ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ವೀಕ್ಷಿಸಲು ವೀಡಿಯೊ ಚಿತ್ರವನ್ನು ಬಳಸಿ. ನಿಮ್ಮ ಕಣ್ಣುಗಳ ಮುಂದೆ ನಿಮ್ಮ ಮುಖದ ವಿರುದ್ಧ ಪೆನ್ನನ್ನು ಅಡ್ಡಲಾಗಿ ಹಿಡಿದುಕೊಳ್ಳಿ. ನಿಮ್ಮ ಬಲ ಮತ್ತು ಎಡ ಹೆಬ್ಬೆರಳಿನ ಉಗುರುಗಳನ್ನು ನಿಮ್ಮ ಬಲ ಮತ್ತು ಎಡ ವಿದ್ಯಾರ್ಥಿಗಳ ಕೇಂದ್ರಗಳೊಂದಿಗೆ ಜೋಡಿಸಿ. ನಂತರ ನಿಮ್ಮ ಹೆಬ್ಬೆರಳುಗಳ ನಡುವಿನ ಪ್ರತ್ಯೇಕತೆಯನ್ನು ಅಳೆಯಲು ಆನ್-ಸ್ಕ್ರೀನ್ ರೂಲರ್‌ಗೆ ಪೆನ್ ಅನ್ನು ತನ್ನಿ. ನಿಮ್ಮ ಎಡಗೈ ಹೆಬ್ಬೆರಳನ್ನು ಶೂನ್ಯದಿಂದ ಜೋಡಿಸಿ ಮತ್ತು ನಿಮ್ಮ ಬಲ ಹೆಬ್ಬೆರಳು ಎಲ್ಲಿದೆ ಎಂಬುದನ್ನು ಗಮನಿಸಿ. ಪೆನ್ ಕೆಳಗೆ ಇರಿಸಿ ಮತ್ತು ಆ ಸಮಯದಲ್ಲಿ ರೂಲರ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ. ಅಂತಿಮವಾಗಿ, ಮುಂದುವರೆಯಲು ಸರಿ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "Loading...",
    lt: "Mes išmatuosime atstumą tarp jūsų akių. Norėdami stebėti savo akis, naudokite vaizdo įrašą. Laikykite rašiklį horizontaliai prie veido prieš akis. Sulygiuokite dešiniojo ir kairiojo nykščio nagus su dešiniojo ir kairiojo vyzdžių centrais. Tada nuneškite rašiklį prie ekrano liniuotės, kad pamatytumėte atstumą tarp nykščių. Kairįjį nykštį sulygiuokite su nuliu ir atkreipkite dėmesį, kur yra dešinysis nykštys. Nuleiskite rašiklį ir spustelėkite liniuotę toje vietoje. Galiausiai spustelėkite Gerai, kad tęstumėte.",
