    tl: "Susukatin namin ang distansya sa pagitan ng iyong mga mata. Gamitin ang larawan ng video upang panoorin ang iyong mga mata. Hawakan ang panulat nang pahalang sa iyong mukha sa harap ng iyong mga mata. Ihanay ang iyong kanan at kaliwang mga kuko ng hinlalaki sa mga gitna ng iyong kanan at kaliwang mga mag-aaral. Pagkatapos ay dalhin ang panulat sa on-screen ruler upang sukatin ang paghihiwalay sa pagitan ng iyong mga hinlalaki. I-align ang iyong kaliwang hinlalaki sa zero at pansinin kung nasaan ang iyong kanang hinlalaki. Ibaba ang panulat at i-click ang ruler sa puntong iyon. Panghuli, i-click ang OK upang magpatuloy.",
    tr: "Gözleriniz arasındaki mesafeyi ölçeceğiz. Gözlerinizi izlemek için video görüntüsünü kullanın. Bir kalemi gözlerinizin önünde yüzünüze yatay olarak tutun. Sağ ve sol baş parmak tırnaklarınızı sağ ve sol göz bebeklerinizin merkezleriyle hizalayın. Ardından kalemi başparmaklarınız arasındaki mesafeyi ölçmek için ekrandaki cetvele getirin. Sol baş parmağınızı sıfıra hizalayın ve sağ baş parmağınızın nerede olduğunu fark edin. Kalemi bırakın ve cetvele o noktada tıklayın. Son olarak devam etmek için Tamam'a tıklayın.",
    ur: "ہم آپ کی آنکھوں کے درمیان فاصلے کی پیمائش کریں گے۔ اپنی آنکھوں کو دیکھنے کے لیے ویڈیو امیج کا استعمال کریں۔ اپنی آنکھوں کے سامنے اپنے چہرے کے خلاف افقی طور پر قلم پکڑیں۔ اپنے دائیں اور بائیں انگوٹھے کے ناخنوں کو اپنے دائیں اور بائیں شاگردوں کے مراکز کے ساتھ سیدھ میں رکھیں۔ پھر اپنے انگوٹھوں کے درمیان علیحدگی کی پیمائش کرنے کے لیے قلم کو آن اسکرین رولر پر لائیں۔ اپنے بائیں انگوٹھے کو صفر سے سیدھا کریں اور دیکھیں کہ آپ کا دایاں انگوٹھا کہاں ہے۔ قلم نیچے رکھیں اور اس مقام پر حکمران پر کلک کریں۔ آخر میں، جاری رکھنے کے لیے ٹھیک ہے پر کلک کریں۔",
