    ro: "Loading...",
    ru: "ОБЕСПЕЧЕНИЕ КОНФИДЕНЦИАЛЬНОСТИ МИКРОФОНА. Во время записи программное обеспечение воспроизводит громкие звуки и наглядно отображает: «Пожалуйста, тишина. Сейчас идет запись». Запись используется исключительно для измерения свойств микрофона и громкоговорителя, а затем стирается в течение 30 секунд. Сохраняются только характеристики микрофона и громкоговорителя.",
    sr: "Loading...",
