    hy: "1. ⇧🔊 ՄԱՔՍ ԾԱՎԱԼ. Ճշգրիտ ձայն ստանալու համար խնդրում ենք առավելագույնի հասցնել ձեր համակարգչի ձայնի ծավալը հիմա, այնուհետև մի դիպչեք ձայնին մինչև նիստի ավարտը:\n2. ԱԿՆՋԻՉՆԵՐ ՉԿԱ։ Հեռացրեք և անջատեք ցանկացած ականջակալներ/ականջակալներ, քանի որ դրանք կդարձնեն ձայնը ոչ ճշգրիտ:",
    bg: "1. ⇧🔊 МАКСИМАЛЕН ОБЕМ. За точен звук, моля, увеличете силата на звука на компютъра си сега и след това не докосвайте силата на звука, докато сесията не приключи.\n2. БЕЗ СЛУШАЛКИ. Отстранете и разкачете всички слушалки/тапи, защото биха направили звука неточен.",
    "zh-CN":
      "1. ⇧🔊 最大音量。为了获得准确的音质，请立即将电脑音量调到最大，并且在会话结束前请勿再调整音量。\n2. 禁止佩戴耳机。请摘下并断开所有耳机/耳塞，因为它们会影响音质。",
    "zh-TW":
      "1. ⇧🔊 最大音量。為了獲得準確的音質，請立即將電腦音量調到最大，並且在會話結束前請勿再調整音量。\n2. 禁止佩戴耳機。請摘下並斷開所有耳機/耳塞，因為它們會影響音質。",
    hr: "1. ⇧🔊 MAKSIMALNI VOLUME. Za točan zvuk, maksimalno povećajte glasnoću zvuka vašeg računala sada, a zatim ne dirajte glasnoću dok sesija ne završi.\n2. BEZ SLUŠALICA. Uklonite i odspojite sve slušalice/bubice jer bi zvuk bio netočan.",
    cs: "Loading...",
    da: "1. ⇧🔊 MAKS. LYDSTYRKE. For nøjagtig lyd skal du maksimere din computers lydstyrke nu og derefter ikke røre ved lydstyrken, før sessionen slutter.\n2. INGEN HOVEDTELEFONER. Fjern og frakobl eventuelle hovedtelefoner/øretelefoner, da de ville gøre lyden unøjagtig.",
    nl: "Loading...",
    fi: "1. ⇧🔊 MAX VOLUME. Tarkka äänen saamiseksi maksimoi tietokoneesi äänenvoimakkuus nyt ja älä kosketa äänenvoimakkuutta ennen kuin istunto on päättynyt.\n2. EI KUULOKKEITA. Irrota ja irrota kuulokkeet/nappikuulokkeet, koska ne tekisivät äänestä epätarkan.",
    fr: "1. ⇧🔊 VOLUME MAXIMUM. Pour un son précis, augmentez le volume de votre ordinateur au maximum, puis ne le touchez plus jusqu'à la fin de la session.\n2. PAS DE CASQUE. Retirez et débranchez tout casque/écouteur, car ils pourraient fausser le son.",
    de: "1. ⇧🔊 MAXIMALE LAUTSTÄRKE. Für einen präzisen Klang stellst du die Lautstärke deines Computers jetzt auf das Maximum und berührst sie danach nicht mehr, bis die Sitzung beendet ist.\n2. KEINE KOPFHÖRER. Entferne alle Kopfhörer/Ohrhörer, da diese den Klang verfälschen.",
    el: "1. ⇧🔊 MAX VOLUME. Για ακριβή ήχο, μεγιστοποιήστε την ένταση ήχου του υπολογιστή σας τώρα και, στη συνέχεια, μην αγγίζετε την ένταση μέχρι να τελειώσει η περίοδος λειτουργίας.\n2. ΟΧΙ ΑΚΟΥΣΤΙΚΑ. Αφαιρέστε και αποσυνδέστε τυχόν ακουστικά/ ακουστικά, γιατί θα έκαναν τον ήχο ανακριβή.",
    he: "Loading...",
    hi: "Loading...",
    hu: "1. ⇧🔊 MAXIMÁLIS HANGERŐ. A pontos hangzás érdekében maximalizálja számítógépe hangerejét, majd ne érintse meg a hangerőt a munkamenet végéig.\n2. NINCS FEJHALLGATÓ. Távolítsa el és húzza ki a fejhallgatót/fülhallgatót, mert pontatlanná tenné a hangot.",
    is: "1. ⇧🔊 HÁMARKSRÁÐ. Til að fá nákvæmt hljóð skaltu hámarka hljóðstyrk tölvunnar núna og ekki snerta hljóðstyrkinn fyrr en lotunni lýkur.\n2. ENGIN heyrnartól. Fjarlægðu og aftengdu öll heyrnartól/eyrnatól, því þau myndu gera hljóðið ónákvæmt.",
    id: "Loading...",
    it: "1. ⇧🔊 VOLUME MASSIMO. Per un suono preciso, imposta al massimo il volume del computer ora e non toccarlo fino al termine della sessione.\n2. NIENTE CUFFIE. Rimuovi e scollega eventuali cuffie/auricolari, perché renderebbero il suono impreciso.",
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "1. ⇧🔊 MAKSYMALNA GŁOŚNOŚĆ. Aby uzyskać dokładny dźwięk, zmaksymalizuj teraz głośność dźwięku komputera, a następnie nie zmieniaj głośności do zakończenia sesji.\n2. BRAK SŁUCHAWEK. Zdejmij i odłącz słuchawki/wkładki douszne, ponieważ mogą one powodować niedokładność dźwięku.",
    pt: "Loading...",
    ro: "1. ⇧🔊 VOLUM MAX. Pentru un sunet precis, maximizați acum volumul sunetului computerului și apoi nu atingeți volumul până la sfârșitul sesiunii.\n2. FĂRĂ CĂȚI. Scoateți și deconectați orice căști/căști, deoarece ar face sunetul inexact.",
    ru: "1. ⇧🔊 МАКСИМАЛЬНАЯ ГРОМКОСТЬ. Для точного звука, пожалуйста, увеличьте громкость звука вашего компьютера сейчас, а затем не трогайте громкость до окончания сеанса.\n2. БЕЗ НАУШНИКОВ. Снимите и отсоедините все наушники/вкладыши, так как они сделают звук неточным.",
    sr: "1. ⇧🔊 МАКСИМАЛНИ ВОЛУМЕ. За прецизан звук, повећајте јачину звука на рачунару сада, а затим не додирујте јачину звука док се сесија не заврши.\n2. НЕМА СЛУШАЛИЦА. Уклоните и ископчајте све слушалице/ушице, јер би оне учиниле звук нетачним.",
    es: "Loading...",
    sw: "1. ⇧🔊 MAX VOLUME. Kwa sauti sahihi, tafadhali ongeza sauti ya kompyuta yako sasa, kisha usiguse sauti hadi kipindi kiishe.\n2. HAKUNA HEADPHONES. Ondoa na utenganishe vipokea sauti vya masikioni/vipokea sauti vya masikioni, kwa sababu vinaweza kufanya sauti kuwa isiyo sahihi.",
    sv: "Loading...",
    tl: "Loading...",
    tr: "1. ⇧🔊 MAKSİMUM SES. Doğru ses için lütfen bilgisayarınızın ses seviyesini şimdi en üst düzeye çıkarın ve ardından oturum sona erene kadar sese dokunmayın.\n2. KULAKLIK YOK. Kulaklıkları/kulak içi kulaklıkları çıkarın ve bağlantısını kesin, çünkü sesi yanlış yaparlar.",
    ur: "1. ⇧🔊 زیادہ سے زیادہ حجم۔ درست آواز کے لیے، براہ کرم اپنے کمپیوٹر کی آواز والیوم کو ابھی زیادہ سے زیادہ کریں، اور پھر سیشن ختم ہونے تک والیوم کو مت چھوئیں۔\n2. کوئی ہیڈ فون نہیں۔ کسی بھی ہیڈ فون/ایئربڈ کو ہٹا دیں اور منقطع کریں، کیونکہ وہ آواز کو غلط بنا دیں گے۔",
