    ar: "Loading...",
    hy: "Մենք չափելու ենք այս էկրանի չափը։ Օգտագործեք բացվող ընտրացանկը՝ հարմար բան ընտրելու համար: Դուք կարող եք օգտագործել ցանկացած սովորական USB միակցիչ (ներառյալ ձեր համակարգչին սնուցող սարքը) կամ վարկային քարտ (կամ նույն չափի ցանկացած քարտ): Տեղադրեք ձեր առարկան էկրանին և շարժեք սահիչը՝ պատկերը հարմարեցնելու ձեր օբյեկտի չափին: Երբ դրանք համընկնեն, սեղմեք RETURN (կամ սեղմեք OK)՝ շարունակելու համար:",
