    "zh-CN":
      "我们将测量此屏幕的尺寸。使用下拉菜单选择合适的尺寸。您可以使用任何常见的 USB 接口（包括为电脑供电的接口）或信用卡（或任何相同尺寸的卡片）。将物体放置在屏幕上，然后移动滑块调整图像以匹配物体的尺寸。匹配后，按“RETURN”（或点击“确定”）继续。",
    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "Změříme velikost této obrazovky. Použijte rozbalovací nabídku a vyberte si něco užitečného. Můžete použít jakýkoli běžný konektor USB (včetně toho, který napájí váš počítač) nebo kreditní kartu (nebo jakoukoli kartu stejné velikosti). Umístěte objekt na obrazovku a posunutím posuvníku upravte obrázek tak, aby odpovídal velikosti vašeho objektu. Když se shodují, pokračujte stisknutím RETURN (nebo kliknutím na OK).",
    da: "Loading...",
    nl: "We meten de grootte van dit scherm. Gebruik het pulldownmenu om iets handigs te kiezen. U kunt elke gangbare USB-aansluiting gebruiken (inclusief de aansluiting die uw computer van stroom voorziet) of een creditcard (of een andere kaart van hetzelfde formaat). Plaats uw object op het scherm en verplaats de schuifbalk om de afbeelding aan te passen aan de grootte van uw object. Wanneer de afmetingen overeenkomen, drukt u op RETURN (of klikt u op OK) om verder te gaan.",
    fi: "Loading...",
    fr: "Nous allons mesurer la taille de cet écran. Utilisez le menu déroulant pour choisir une option pratique. Vous pouvez utiliser n'importe quel connecteur USB standard (y compris celui qui alimente votre ordinateur) ou une carte de crédit (ou toute autre carte de même taille). Placez votre objet sur l'écran et déplacez le curseur pour ajuster l'image à sa taille. Une fois la taille de l'objet atteinte, appuyez sur RETOUR (ou cliquez sur OK) pour continuer.",
    de: "Loading...",
    el: "Θα μετρήσουμε το μέγεθος αυτής της οθόνης. Χρησιμοποιήστε το αναπτυσσόμενο μενού για να επιλέξετε κάτι εύχρηστο. Μπορείτε να χρησιμοποιήσετε οποιαδήποτε κοινή υποδοχή USB (συμπεριλαμβανομένης αυτής που παρέχει τροφοδοσία στον υπολογιστή σας) ή μια πιστωτική κάρτα (ή οποιαδήποτε κάρτα ίδιου μεγέθους). Τοποθετήστε το αντικείμενό σας στην οθόνη και μετακινήστε το ρυθμιστικό για να προσαρμόσετε την εικόνα ώστε να ταιριάζει με το μέγεθος του αντικειμένου σας. Όταν ταιριάζουν, πατήστε RETURN (ή κάντε κλικ στο OK) για να προχωρήσετε.",
    he: "Loading...",
    hi: "Loading...",
    hu: "Megmérjük ennek a képernyőnek a méretét. A legördülő menü segítségével válasszon valami hasznosat. Használhat bármilyen általános USB-csatlakozót (beleértve azt is, amelyik a számítógép áramellátását biztosítja), vagy hitelkártyát (vagy bármilyen azonos méretű kártyát). Helyezze az objektumot a képernyőre, és mozgassa a csúszkát, hogy a képet az objektum méretéhez igazítsa. Ha megegyeznek, nyomja meg a RETURN gombot (vagy kattintson az OK gombra) a folytatáshoz.",
    is: "Loading...",
    id: "Kami akan mengukur ukuran layar ini. Gunakan menu tarik-turun untuk memilih sesuatu yang praktis. Anda dapat menggunakan konektor USB umum (termasuk yang menyediakan daya ke komputer Anda) atau kartu kredit (atau kartu apa pun dengan ukuran yang sama). Letakkan objek Anda di layar dan gerakkan penggeser untuk menyesuaikan gambar agar sesuai dengan ukuran objek Anda. Jika sudah cocok, tekan RETURN (atau klik OK) untuk melanjutkan.",
