    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "ഈ സ്ക്രീനിൻ്റെ വലിപ്പം ഞങ്ങൾ അളക്കും. സൗകര്യപ്രദമായ എന്തെങ്കിലും തിരഞ്ഞെടുക്കാൻ പുൾ-ഡൗൺ മെനു ഉപയോഗിക്കുക. നിങ്ങൾക്ക് ഏതെങ്കിലും സാധാരണ USB കണക്ടറോ (നിങ്ങളുടെ കമ്പ്യൂട്ടറിന് പവർ നൽകുന്നതുൾപ്പെടെ) അല്ലെങ്കിൽ ഒരു ക്രെഡിറ്റ് കാർഡോ (അല്ലെങ്കിൽ അതേ വലിപ്പത്തിലുള്ള ഏതെങ്കിലും കാർഡ്) ഉപയോഗിക്കാം. നിങ്ങളുടെ ഒബ്‌ജക്‌റ്റ് സ്‌ക്രീനിൽ വയ്ക്കുക, നിങ്ങളുടെ ഒബ്‌ജക്‌റ്റിൻ്റെ വലുപ്പവുമായി പൊരുത്തപ്പെടുന്നതിന് ചിത്രം ക്രമീകരിക്കുന്നതിന് സ്ലൈഡർ നീക്കുക. അവ പൊരുത്തപ്പെടുമ്പോൾ, തുടരാൻ RETURN അമർത്തുക (അല്ലെങ്കിൽ ശരി ക്ലിക്കുചെയ്യുക).",
    no: "Vi vil måle størrelsen på denne skjermen. Bruk rullegardinmenyen for å velge noe praktisk. Du kan bruke en hvilken som helst vanlig USB-kontakt (inkludert den som gir strøm til datamaskinen din) eller et kredittkort (eller et hvilket som helst kort av samme størrelse). Plasser objektet på skjermen og flytt glidebryteren for å justere bildet slik at det passer med objektets størrelse. Når de samsvarer, trykk RETURN (eller klikk OK) for å fortsette.",
