    pt: "Loading...",
    ro: "Loading...",
    ru: "ВЫБЕРИТЕ СПОСОБ КАЛИБРОВКИ ДИНАМИКОВ:\n1. УЖЕ СДЕЛАНО. Если вы ранее калибровали динамики этого компьютера, у вас может быть возможность пропустить повторную калибровку, повторно используя существующий профиль калибровки. В противном случае выберите микрофон для калибровки. Примечание: правила безопасности веб-приложений ограничивают распознаваемость компьютера, поэтому уже откалиброванный компьютер может остаться нераспознанным. Если это произойдет, просто выполните повторную калибровку. Вероятно, он будет распознан в следующий раз.\n2. СМАРТФОН. Используйте встроенный микрофон вашего смартфона.\n3. USB. Если у вас есть микрофон miniDSP UMIK-1 или UMIK-2 (доступный на Amazon), выберите «USB» и подключите микрофон к этому компьютеру.",
    sr: "Loading...",
    es: "Loading...",
    sw: 'CHAGUA JINSI YA KUHARIBU WASEMAJI WAKO:\n1. TAYARI IMEKWISHA. Ikiwa hapo awali ulirekebisha vipaza sauti vya kompyuta hii, unaweza kuwa na chaguo la kuruka urekebishaji upya kwa kutumia tena wasifu wako uliopo wa urekebishaji. Vinginevyo, chagua maikrofoni ili kusawazisha. Kumbuka: Sheria za usalama za programu ya wavuti hupunguza utambuzi wa kompyuta, kwa hivyo kompyuta iliyosawazishwa tayari inaweza kutotambuliwa. Ikiwa hii itatokea, rekebisha tu. Pengine itatambuliwa wakati ujao.\n2. SMARTPHONE. Tumia maikrofoni iliyojengewa ndani ya simu yako mahiri.\n3. USB. Ikiwa unamiliki maikrofoni ya miniDSP UMIK-1 au UMIK-2 (inapatikana kwenye Amazon), chagua "USB" na uunganishe maikrofoni yako kwenye kompyuta hii.',
