    ar: '١. ضع هذا الهاتف على منصتك بحيث يكون الميكروفون (هذه الحافة ⇧) مواجهًا لجهاز الكمبيوتر.\n\n٢. اضبط موضع الهاتف وارتفاع المنصة بحيث يكون الميكروفون في مجال رؤيتك لمكبرات الصوت، والتي عادةً ما تكون في لوحة المفاتيح.\n\n٣. انقر على "متابعة".\n\n٤. إذا لم يستجب الزر، فقم بتحديث هذه الشاشة (انقر على العنوان؛ انقر على "انتقال") أو وجّه الكاميرا نحو رمز الاستجابة السريعة مرة أخرى.',
