    "en-US_1":
      "❌ Sorry, the most recent left and right measurements were inconsistent. Try again? Keep one eye closed. Focus on the cross and monitor the flashing dot out of the corner of your eye. Slide the dot left and right until it disappears into your blindspot, and then hit the SPACE bar. Maintain your viewing distance as you test both eyes.",
    ar: "Loading...",
    hy: "❌ Ներողություն, ձախ և աջ վերջին չափումները անհամապատասխան էին: Կրկին փորձե՞լ: Մի աչքը փակ պահեք։ Կենտրոնացեք խաչի վրա և հետևեք ձեր աչքի անկյունից դուրս գտնվող թարթող կետին: Կետը սահեցրեք ձախ և աջ, մինչև այն անհետանա ձեր կույր կետի մեջ, այնուհետև սեղմեք SPACE սանդղակը: Պահպանեք ձեր դիտման հեռավորությունը, երբ փորձարկում եք երկու աչքերը:",
    bg: "❌ За съжаление последните леви и десни измервания не съответстват. Опитайте отново? Дръжте едното си око затворено. Фокусирайте се върху кръста и наблюдавайте мигащата точка с ъгъла на окото си. Плъзнете точката наляво и надясно, докато изчезне в сляпото ви петно, след което натиснете ИНТЕРВАЛ. Поддържайте разстоянието на гледане, докато тествате и двете очи.",
    "zh-CN": "Loading...",
    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "Loading...",
    da: "❌ Beklager, de seneste målinger til venstre og højre var inkonsekvente. Prøv igen? Hold det ene øje lukket. Fokuser på korset og overvåg den blinkende prik ud af øjenkrogen. Skub prikken til venstre og højre, indtil den forsvinder ind i din blindspot, og tryk derefter på MELLEMRUM. Hold din synsafstand, mens du tester begge øjne.",
    nl: "❌ Sorry, de meest recente metingen links en rechts waren inconsistent. Probeer het opnieuw. Houd één oog dicht. Focus op het kruis en let op het knipperende stipje in je ooghoek. Beweeg het stipje naar links en rechts tot het in je blinde vlek verdwijnt en druk vervolgens op de spatiebalk. Houd je kijkafstand aan terwijl je beide ogen test.",
    fi: "❌ Valitettavasti viimeisimmät vasemman ja oikeanpuoleiset mittaukset olivat epäjohdonmukaisia. Yritätkö uudelleen? Pidä toinen silmä kiinni. Keskity ristiin ja tarkkaile vilkkuvaa pistettä silmäkulmassasi. Liu'uta pistettä vasemmalle ja oikealle, kunnes se katoaa sokealle pisteelle, ja paina sitten VÄLINÄPPÄINTÄ. Säilytä katseluetäisyys, kun testaat molempia silmiä.",
    fr: "❌ Désolé, les mesures gauche et droite les plus récentes étaient incohérentes. Réessayer ? Gardez un œil fermé. Concentrez-vous sur la croix et observez le point clignotant du coin de l'œil. Faites glisser le point vers la gauche et la droite jusqu'à ce qu'il disparaisse dans votre angle mort, puis appuyez sur la barre d'espace. Maintenez votre distance de vision pendant que vous testez vos deux yeux.",
    de: "Loading...",
    el: "❌ Λυπούμαστε, οι πιο πρόσφατες μετρήσεις αριστερά και δεξιά ήταν ασυνεπείς. Δοκιμάστε ξανά; Κρατήστε το ένα μάτι κλειστό. Εστιάστε στον σταυρό και παρακολουθήστε την κουκκίδα που αναβοσβήνει με την άκρη του ματιού σας. Σύρετε την κουκκίδα αριστερά και δεξιά μέχρι να εξαφανιστεί στο blindspot σας και, στη συνέχεια, πατήστε τη γραμμή SPACE. Διατηρήστε την απόσταση θέασης καθώς δοκιμάζετε και τα δύο μάτια.",
    he: "Loading...",
    hi: "Loading...",
    hu: "❌ Sajnáljuk, a legutóbbi bal és jobb oldali mérések következetlenek voltak. Megpróbálja újra? Tartsa az egyik szemét csukva. Koncentrálj a keresztre, és figyeld a villogó pontot a szemed sarkából. Csúsztassa a pontot balra és jobbra, amíg el nem tűnik a vakfoltban, majd nyomja meg a SZÓKÖZ billentyűt. Mindkét szem tesztelésekor tartsa be a látótávolságot.",
    is: "❌ Því miður, nýjustu vinstri og hægri mælingar voru ósamkvæmar. Reyna aftur? Hafðu annað augað lokað. Einbeittu þér að krossinum og fylgdu blikkandi punktinum út úr augnkróknum. Renndu punktinum til vinstri og hægri þar til hann hverfur inn í blindblettinn þinn og ýttu svo á bil. Haltu útsýnisfjarlægð þinni þegar þú prófar bæði augun.",
    id: "Loading...",
    it: "❌ Spiacenti, le misurazioni più recenti a sinistra e a destra non erano coerenti. Riprovare? Tieni un occhio chiuso. Concentrati sulla croce e osserva il punto lampeggiante con la coda dell'occhio. Fai scorrere il punto a sinistra e a destra finché non scompare nel tuo punto cieco, quindi premi la barra SPAZIATRICE. Mantieni la distanza di visione mentre esegui il test con entrambi gli occhi.",
    ja: "❌ 申し訳ございません。左右の測定値にばらつきがありました。もう一度お試しください。片目を閉じてください。十字に焦点を合わせ、目の端で点滅する点を監視してください。点を左右にスライドさせ、死角に消えたらスペースキーを押します。両目で検査する際は、視距離を保ってください。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "❌ Przepraszamy, ostatnie pomiary lewej i prawej strony były niespójne. Spróbuj ponownie? Zamknij jedno oko. Skup się na krzyżyku i obserwuj migający punkt kątem oka. Przesuwaj punkt w lewo i prawo, aż zniknie w martwym polu, a następnie naciśnij spację. Zachowaj odległość oglądania, testując oboje oczu.",
    pt: "❌ Desculpe, as medições mais recentes dos olhos esquerdo e direito estavam inconsistentes. Tentar novamente? Mantenha um olho fechado. Concentre-se na cruz e observe o ponto piscante no canto do olho. Deslize o ponto para a esquerda e para a direita até que ele desapareça no seu ponto cego e, em seguida, pressione a barra de ESPAÇO. Mantenha a distância de visão enquanto testa os dois olhos.",
    ro: "Loading...",
    ru: "❌ Извините, последние левые и правые измерения были несовместимы. Попробуйте еще раз? Держите один глаз закрытым. Сосредоточьтесь на кресте и следите за мигающей точкой краем глаза. Двигайте точку влево и вправо, пока она не исчезнет в слепой зоне, а затем нажмите клавишу ПРОБЕЛ. Сохраняйте расстояние между глазами, проверяя оба глаза.",
