    "en-US":
      "EXPLANATION. There are four steps. \n1. Pick a suitable object, which can be your hand with outstretched fingers.\n2. Use the two vertical green bars to measure the object’s length. Place the object’s left edge at the left line. \n3. Use the left/right arrow keys, or dragging, to move the right line to the object’s right edge. \n3. Use the measured object to set the distance from your computer’s camera to your eye. \n4. Holding your head still, lower the object to allow the camera to see your face, and press the RETURN key. ",
