    ar: "شرح. هناك أربع خطوات.\n1. اختر جسمًا مناسبًا، ويمكن أن يكون يدك بأصابع ممدودة.\n2. استخدم الخطين الأخضرين العموديين لقياس طول الجسم. ضع الحافة اليسرى للجسم على الخط الأيسر.\n3. استخدم مفاتيح الأسهم اليسرى/اليمنى، أو اسحب، لتحريك الخط الأيمن إلى الحافة اليمنى للجسم.\n3. استخدم الجسم المقاس لضبط المسافة بين كاميرا الكمبيوتر وعينك.\n4. حافظ على ثبات رأسك، وأنزل الجسم للسماح للكاميرا برؤية وجهك، ثم اضغط على مفتاح الرجوع.",
