    cs: "VYSVĚTLENÍ. Existují čtyři kroky. \n1. Vyberte si vhodný předmět, kterým může být vaše ruka s nataženými prsty.\n2. Pomocí dvou svislých zelených pruhů změřte délku objektu. Umístěte levý okraj objektu na levou čáru. \n3. Pomocí kláves se šipkami doleva/doprava nebo tažením přesuňte pravou čáru k pravému okraji objektu. \n3. Pomocí měřeného objektu nastavte vzdálenost od fotoaparátu počítače k ​​oku. \n4. Držte hlavu v klidu, sklopte předmět, aby kamera viděla vaši tvář, a stiskněte klávesu RETURN. ",
    da: "FORKLARING. Der er fire trin. \n1. Vælg en passende genstand, som kan være din hånd med strakte fingre.\n2. Brug de to lodrette grønne streger til at måle objektets længde. Placer objektets venstre kant ved venstre linje. \n3. Brug venstre/højre piletasterne, eller træk, for at flytte den højre linje til objektets højre kant. \n3. Brug det målte objekt til at indstille afstanden fra din computers kamera til dit øje. \n4. Hold hovedet stille, sænk objektet for at lade kameraet se dit ansigt, og tryk på RETURN-tasten. ",
