    he: "הֶסבֵּר. יש ארבעה שלבים. \n1. בחרו חפץ מתאים, שיכול להיות היד שלכם באצבעות מושטות.\n2. השתמש בשני הפסים הירוקים האנכיים כדי למדוד את אורך האובייקט. מקם את הקצה השמאלי של האובייקט בקו השמאלי. \n3. השתמש במקשי החצים שמאלה/ימינה, או בגרירה, כדי להזיז את הקו הימני לקצה הימני של האובייקט. \n3. השתמש באובייקט הנמדד כדי להגדיר את המרחק ממצלמת המחשב שלך לעין שלך. \n4. החזק את הראש בשקט, הורד את האובייקט כדי לאפשר למצלמה לראות את הפנים שלך, ולחץ על מקש RETURN. ",
    hi: "व्याख्या। इसमें चार चरण हैं। \n1. कोई उपयुक्त वस्तु चुनें, जो फैली हुई उंगलियों वाला आपका हाथ हो सकता है।\n2. वस्तु की लंबाई मापने के लिए दो ऊर्ध्वाधर हरी पट्टियों का उपयोग करें। वस्तु के बाएं किनारे को बाईं रेखा पर रखें।\n3. दाईं रेखा को वस्तु के दाएं किनारे पर ले जाने के लिए बाएं/दाएं तीर कुंजियों या ड्रैगिंग का उपयोग करें।\n3. मापी गई वस्तु का उपयोग करके अपने कंप्यूटर के कैमरे से अपनी आंख तक की दूरी निर्धारित करें।\n4. अपना सिर स्थिर रखते हुए, वस्तु को नीचे करें ताकि कैमरा आपका चेहरा देख सके, और रिटर्न कुंजी दबाएँ।",
    hu: "Loading...",
