    id: "PENJELASAN. Ada empat langkah. \n1. Pilih objek yang sesuai, bisa berupa tangan Anda dengan jari-jari terentang.\n2. Gunakan dua garis hijau vertikal untuk mengukur panjang objek. Letakkan tepi kiri objek di garis kiri. \n3. Gunakan tombol panah kiri/kanan, atau seret, untuk memindahkan garis kanan ke tepi kanan objek. \n3. Gunakan objek yang diukur untuk mengatur jarak dari kamera komputer ke mata Anda. \n4. Tahan kepala Anda, turunkan objek agar kamera dapat melihat wajah Anda, lalu tekan tombol RETURN.",
    it: "Loading...",
    ja: "Loading...",
    kn: "ವಿವರಣೆ ನಾಲ್ಕು ಹಂತಗಳಿವೆ. \n1. ಸೂಕ್ತವಾದ ವಸ್ತುವನ್ನು ಆರಿಸಿ, ಅದು ಚಾಚಿದ ಬೆರಳುಗಳೊಂದಿಗೆ ನಿಮ್ಮ ಕೈಯಾಗಿರಬಹುದು.\n2. ವಸ್ತುವಿನ ಉದ್ದವನ್ನು ಅಳೆಯಲು ಎರಡು ಲಂಬ ಹಸಿರು ಬಾರ್‌ಗಳನ್ನು ಬಳಸಿ. ವಸ್ತುವಿನ ಎಡ ಅಂಚನ್ನು ಎಡ ಸಾಲಿನಲ್ಲಿ ಇರಿಸಿ. \n3. ವಸ್ತುವಿನ ಬಲ ಅಂಚಿಗೆ ಬಲ ರೇಖೆಯನ್ನು ಸರಿಸಲು ಎಡ/ಬಲ ಬಾಣದ ಕೀಲಿಗಳನ್ನು ಬಳಸಿ ಅಥವಾ ಎಳೆಯಿರಿ. \n3. ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನ ಕ್ಯಾಮರಾದಿಂದ ನಿಮ್ಮ ಕಣ್ಣಿಗೆ ಇರುವ ಅಂತರವನ್ನು ಹೊಂದಿಸಲು ಅಳತೆ ಮಾಡಿದ ವಸ್ತುವನ್ನು ಬಳಸಿ. \n4. ನಿಮ್ಮ ತಲೆಯನ್ನು ಸ್ಥಿರವಾಗಿ ಹಿಡಿದುಕೊಳ್ಳಿ, ಕ್ಯಾಮರಾಗೆ ನಿಮ್ಮ ಮುಖವನ್ನು ನೋಡಲು ಅನುಮತಿಸಲು ವಸ್ತುವನ್ನು ಕಡಿಮೆ ಮಾಡಿ ಮತ್ತು ರಿಟರ್ನ್ ಕೀಯನ್ನು ಒತ್ತಿರಿ. ",
    ko: "설명. 네 단계가 있습니다.\n1. 손가락을 쭉 뻗은 손과 같은 적절한 물체를 선택하세요.\n2. 두 개의 녹색 세로 막대를 사용하여 물체의 길이를 측정하세요. 물체의 왼쪽 가장자리를 왼쪽 선에 놓으세요.\n3. 왼쪽/오른쪽 화살표 키를 사용하거나 드래그하여 오른쪽 선을 물체의 오른쪽 가장자리로 이동하세요.\n3. 측정된 물체를 사용하여 컴퓨터 카메라에서 눈까지의 거리를 설정하세요.\n4. 머리를 움직이지 않고 카메라에 얼굴이 보이도록 물체를 내린 후, RETURN 키를 누르세요.",
    lt: "PAAIŠKINIMAS. Yra keturi žingsniai. \n1. Išsirinkite tinkamą daiktą, kuris gali būti jūsų ranka ištiestais pirštais.\n2. Naudokite dvi vertikalias žalias juostas objekto ilgiui išmatuoti. Padėkite kairįjį objekto kraštą kairiojoje eilutėje. \n3. Norėdami perkelti dešinę liniją į dešinįjį objekto kraštą, naudokite rodyklių į kairę / dešinę klavišus arba vilkdami. \n3. Išmatuotu objektu nustatykite atstumą nuo kompiuterio kameros iki akies. \n4. Laikydami galvą nejudėdami, nuleiskite objektą, kad fotoaparatas matytų jūsų veidą, ir paspauskite mygtuką RETURN. ",
    ms: "PENJELASAN. Terdapat empat langkah. \n1. Pilih objek yang sesuai, yang boleh menjadi tangan anda dengan jari terulur.\n2. Gunakan dua bar hijau menegak untuk mengukur panjang objek. Letakkan tepi kiri objek pada baris kiri. \n3. Gunakan kekunci anak panah kiri/kanan, atau seret, untuk mengalihkan garisan kanan ke tepi kanan objek. \n3. Gunakan objek yang diukur untuk menetapkan jarak dari kamera komputer anda ke mata anda. \n4. Sambil menahan kepala anda, turunkan objek untuk membolehkan kamera melihat wajah anda, dan tekan kekunci RETURN. ",
    ml: "Loading...",
