    tl: "PALIWANAG. May apat na hakbang. \n1. Pumili ng isang angkop na bagay, na maaaring ang iyong kamay na may nakaunat na mga daliri.\n2. Gamitin ang dalawang patayong berdeng bar upang sukatin ang haba ng bagay. Ilagay ang kaliwang gilid ng bagay sa kaliwang linya. \n3. Gamitin ang kaliwa/kanang mga arrow key, o pag-drag, upang ilipat ang kanang linya sa kanang gilid ng bagay. \n3. Gamitin ang sinusukat na bagay upang itakda ang distansya mula sa camera ng iyong computer sa iyong mata. \n4. Hawakan ang iyong ulo, ibaba ang bagay upang makita ng camera ang iyong mukha, at pindutin ang RETURN key. ",
