    sv: "Loading...",
    tl: "Sa bawat pagsubok, habang tumitingin ka sa krus, isang triplet ng tatlong random na letra ang mag-FLASH sa sulok ng iyong mata. Isang flash lang. Upang matutunan ang gawain, subukan muna natin ito gamit ang isang STATIC na display. Habang nakatingin sa krus, sa ibaba, nang hindi ginagalaw ang iyong mga mata: Ano ang gitnang titik?\n\n             +             B R C\n\nIto ay isang R. Ang display na ito ay static, kaya magiging madaling ilipat ang iyong mga mata sa titik at tukuyin ito. Ngunit, sa isang tunay na pagsubok, ang mga titik ay FLASHED, kaya walang oras upang ilipat ang iyong mga mata. Mangyaring tingnan ang krus habang sinisimulan mo ang paglilitis. Hindi mahalaga kung saan pupunta ang iyong mga mata pagkatapos ng flash. Ang unang bloke ng pagsubok ay ilan lamang sa mga pagsubok ng pagsasanay, bago tayo magsimula nang masigasig. ",
    tr: "Her denemede, haça bakarken, gözünüzün köşesinde üç rastgele harften oluşan bir üçlü PARLAYACAKTIR. Sadece bir şimşek. Görevi öğrenmek için önce STATİK bir gösterimle deneyelim. Aşağıda, gözlerinizi hareket ettirmeden haça bakarken: Ortadaki harf nedir?\n\n              +              B R C\n\nBu bir R. Bu gösterim statiktir, bu nedenle gözlerinizi harfe hareket ettirmeniz ve onu tanımlamanız kolay olacaktır. Ancak gerçek bir denemede, harfler PARLAYARAK yanıp söner, bu nedenle gözlerinizi hareket ettirmek için zamanınız olmaz. Lütfen denemeyi başlatırken haça bakın. Flaştan sonra gözlerinizin nereye gittiği önemli değildir. İlk test bloğu, ciddi olarak başlamadan önce sadece birkaç pratik denemedir.",
    ur: "ہر آزمائش پر، جب آپ صلیب کو دیکھیں گے، تو آپ کی آنکھ کے کونے میں تین بے ترتیب حروف کا ایک ٹرپلٹ چمکے گا۔ صرف ایک فلیش۔ کام سیکھنے کے لیے، آئیے پہلے اسے ایک STATIC ڈسپلے کے ساتھ آزماتے ہیں۔ کراس کو دیکھتے ہوئے، نیچے، اپنی آنکھیں ہلائے بغیر: درمیانی خط کیا ہے؟\n\n             +             BR C\n\nیہ ایک R ہے۔ یہ ڈسپلے جامد ہے، اس لیے اپنی آنکھوں کو خط کی طرف منتقل کرنا اور اس کی شناخت کرنا آسان ہوگا۔ لیکن، ایک حقیقی آزمائش میں، حروف چمکے ہوئے ہیں، لہذا آپ کی آنکھوں کو حرکت دینے کا وقت نہیں ہے۔ ٹرائل شروع کرتے وقت براہ کرم صلیب کو دیکھیں۔ اس سے کوئی فرق نہیں پڑتا کہ فلیش کے بعد آپ کی آنکھیں کہاں جاتی ہیں۔ ٹیسٹنگ کا پہلا بلاک مشق کے صرف چند ٹرائلز ہیں، اس سے پہلے کہ ہم سنجیدگی سے شروع کریں۔ ",
