      "On each trial, while you look at the cross, a random LLL will FLASH in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display. While looking at the cross, below, without moving your eyes: What LLL is it?\n\n             +               R  \n\nIt’s an R. This display is static, so it would be easy to move your eyes to the LLL and identify it. But, in a real trial, the LLL is FLASHED, so there's no time to move your eyes. Please look at the cross as you initiate the trial. It doesn't matter where your eyes go after the flash. The first block of testing is just a few trials of practice, before we start in earnest.",
