    ar: "Loading...",
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN":
      "每次试验时，当你注视十字时，一个随机的微光（LLL）会在你的眼角闪烁。只是一闪而过。为了学习这项任务，我们先用静态显示来尝试一下。注视下面的十字，眼睛不要移动：这是什么LLL？\n\n+ R\n\n是R。这个显示是静态的，所以很容易将目光移到LLL上并识别出来。但是在真正的试验中，LLL是闪烁的，所以没有时间移动你的目光。请在开始试验时注视十字。闪烁之后你的目光移到哪里都没关系。在我们正式开始之前，第一阶段的测试只是几次练习。",
    "zh-TW": "Loading...",
