    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "Loading...",
    da: "Ved hvert forsøg, mens du ser på korset, vil et tilfældigt bogstav BLINKE i øjenkrogen. Bare et glimt. For at lære opgaven, lad os prøve den først med en STATISK skærm. Mens du kigger på korset, nedenfor, uden at bevæge dine øjne: Hvilket bogstav er det?\n\n             +               R  \n\nDet er et R. Dette display er statisk, så det ville være nemt at flytte dine øjne til bogstavet og identificere det. Men i en rigtig prøvelse blinker brevet, så der er ikke tid til at bevæge øjnene. Se venligst på krydset, mens du starter retssagen. Det er lige meget, hvor dine øjne går efter flashen. Den første blok af test er blot et par øvelser, før vi starter for alvor.",
    nl: "Loading...",
    fi: "Loading...",
    fr: "Loading...",
    de: "Loading...",
    el: "Loading...",
    he: "בכל ניסוי, בזמן שאתה מסתכל על הצלב, אות אקראית תהבהב בזווית העין שלך. רק הבזק. כדי ללמוד את המשימה, בואו ננסה אותה תחילה עם תצוגה STATIC. בעודך מסתכל על הצלב, למטה, מבלי להזיז את עיניך: איזו אות זו?\n\n             +               ר  \n\nזה R. התצוגה הזו סטטית, כך שיהיה קל להעביר את העיניים לאות ולזהות אותה. אבל, במשפט אמיתי, המכתב מהבהב, אז אין זמן להזיז את העיניים. אנא הסתכל על הצלב כשאתה מתחיל את המשפט. זה לא משנה לאן העיניים שלך הולכות אחרי ההבזק. הבלוק הראשון של הבדיקות הוא רק כמה ניסיונות של תרגול, לפני שנתחיל ברצינות.",
    hi: "प्रत्येक परीक्षण में, जब आप क्रॉस को देखते हैं, तो आपकी आंख के कोने में एक यादृच्छिक अक्षर चमकेगा। बस एक चमक। कार्य सीखने के लिए, आइए इसे पहले एक स्थिर प्रदर्शन के साथ आज़माएँ। नीचे दिए गए क्रॉस को देखते हुए, अपनी आँखें हिलाए बिना: यह कौन सा अक्षर है?\n\n               +                 R\n\nयह एक R है। यह डिस्प्ले स्थिर है, इसलिए अक्षर पर अपनी आँखें ले जाना और उसे पहचानना आसान होगा। लेकिन, एक वास्तविक परीक्षण में, अक्षर चमकता है, इसलिए अपनी आँखें हिलाने का कोई समय नहीं है। कृपया परीक्षण शुरू करते समय क्रॉस को देखें। इससे कोई फर्क नहीं पड़ता कि चमक के बाद आपकी आँखें कहाँ जाती हैं। परीक्षण का पहला ब्लॉक अभ्यास के कुछ परीक्षण हैं, इससे पहले कि हम ईमानदारी से शुरू करें।",
    hu: "Loading...",
