    id: "Loading...",
    it: "A ogni prova, mentre guardi la croce, una lettera a caso LAMPEGGERÀ con la coda dell'occhio. Solo un lampo. Per imparare l'esercizio, proviamo prima con una visualizzazione STATICA. Mentre guardi la croce, qui sotto, senza muovere gli occhi: Che lettera è?\n\n              +                R  \n\nÈ una R. Questa visualizzazione è statica, quindi sarebbe facile spostare gli occhi sulla lettera e identificarla. Ma, in una prova reale, la lettera LAMPEGGIA, quindi non c'è tempo per muovere gli occhi. Guarda la croce mentre inizi la prova. Non importa dove vanno i tuoi occhi dopo il lampo. Il primo blocco di test consiste solo in alcune prove di pratica, prima di iniziare sul serio.",
    ja: "Loading...",
    kn: "ಪ್ರತಿ ಪ್ರಯೋಗದಲ್ಲಿ, ನೀವು ಶಿಲುಬೆಯನ್ನು ನೋಡುವಾಗ, ನಿಮ್ಮ ಕಣ್ಣಿನ ಮೂಲೆಯಲ್ಲಿ ಯಾದೃಚ್ಛಿಕ ಅಕ್ಷರವು ಫ್ಲ್ಯಾಶ್ ಆಗುತ್ತದೆ. ಕೇವಲ ಒಂದು ಫ್ಲಾಶ್. ಕೆಲಸವನ್ನು ಕಲಿಯಲು, STATIC ಡಿಸ್ಪ್ಲೇಯೊಂದಿಗೆ ಅದನ್ನು ಮೊದಲು ಪ್ರಯತ್ನಿಸೋಣ. ಶಿಲುಬೆಯನ್ನು ನೋಡುವಾಗ, ಕೆಳಗೆ, ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಚಲಿಸದೆ: ಅದು ಯಾವ ಅಕ್ಷರ?\n\n             +                ಆರ್  \n\nಇದು R. ಈ ಡಿಸ್ಪ್ಲೇ ಸ್ಥಿರವಾಗಿದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಅಕ್ಷರಕ್ಕೆ ಸರಿಸಲು ಮತ್ತು ಅದನ್ನು ಗುರುತಿಸಲು ಸುಲಭವಾಗುತ್ತದೆ. ಆದರೆ, ನಿಜವಾದ ಪ್ರಯೋಗದಲ್ಲಿ, ಪತ್ರವು ಫ್ಲ್ಯಾಶ್ ಆಗಿದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಸರಿಸಲು ಸಮಯವಿಲ್ಲ. ನೀವು ವಿಚಾರಣೆಯನ್ನು ಪ್ರಾರಂಭಿಸುವಾಗ ದಯವಿಟ್ಟು ಶಿಲುಬೆಯನ್ನು ನೋಡಿ. ಫ್ಲ್ಯಾಷ್ ನಂತರ ನಿಮ್ಮ ಕಣ್ಣುಗಳು ಎಲ್ಲಿಗೆ ಹೋಗುತ್ತವೆ ಎಂಬುದು ಮುಖ್ಯವಲ್ಲ. ಪರೀಕ್ಷೆಯ ಮೊದಲ ಬ್ಲಾಕ್ ಅಭ್ಯಾಸದ ಕೆಲವು ಪ್ರಯೋಗಗಳು, ನಾವು ಶ್ರದ್ಧೆಯಿಂದ ಪ್ರಾರಂಭಿಸುವ ಮೊದಲು.",
    ko: "영어: 각 시행에서 십자가를 보는 동안 눈꼬치에 무작위 문자가 깜빡입니다. 그냥 깜빡입니다. 작업을 배우려면 먼저 정적 디스플레이로 시도해 보겠습니다. 눈을 움직이지 않고 아래의 십자가를 보는 동안: 무슨 문자일까요?\n\n              +                R  \n\nR입니다. 이 디스플레이는 정적이므로 눈을 문자로 옮겨 식별하기 쉽습니다. 하지만 실제 시행에서는 문자가 깜빡이므로 눈을 움직일 시간이 없습니다. 시행을 시작할 때 십자가를 보세요. 깜빡임 후 눈이 어디로 가는지는 중요하지 않습니다. 첫 번째 테스트 블록은 본격적으로 시작하기 전에 몇 번의 연습 시행일 뿐입니다.",
    lt: "Kiekvieno bandymo metu, kai žiūrite į kryžių, jūsų akies kamputyje mirksės atsitiktinė raidė. Tiesiog blyksnis. Norėdami išmokti užduotį, pirmiausia išbandykite ją naudodami STATIC ekraną. Žiūrint į kryžių, apačioje, nepajudinant akių: Kokia tai raidė?\n\n             +               R  \n\nTai R. Šis ekranas yra statinis, todėl būtų lengva nukreipti akis į raidę ir ją atpažinti. Tačiau tikrame bandyme raidė mirksėja, todėl nėra laiko pajudinti akių. Pradėdami teismą, pažiūrėkite į kryžių. Nesvarbu, kur krypsta akys po blykstės. Pirmasis bandymų blokas yra tik keli praktikos bandymai, prieš pradedant rimtai.",
    ms: "Pada setiap percubaan, semasa anda melihat salib, huruf rawak akan BERKElip-kelip di sudut mata anda. Sekejap sahaja. Untuk mempelajari tugasan, mari cuba dahulu dengan paparan STATIK. Sambil melihat salib, di bawah, tanpa mengalihkan mata anda: Apakah huruf itu?\n\n             +               R  \n\nIa adalah R. Paparan ini statik, jadi mudah untuk mengalihkan mata anda ke huruf dan mengenal pastinya. Tetapi, dalam percubaan sebenar, surat itu DIFLASH, jadi tiada masa untuk mengalihkan mata anda. Sila lihat salib semasa anda memulakan perbicaraan. Tidak kira ke mana mata anda pergi selepas kilat. Blok pertama ujian hanyalah beberapa percubaan amalan, sebelum kita mula bersungguh-sungguh.",
    ml: "Loading...",
    no: "Loading...",
    fa: "در هر آزمایش، در حالی که به صلیب نگاه می کنید، یک حرف تصادفی در گوشه چشم شما چشمک می زند. فقط یک فلش برای یادگیری کار، اجازه دهید ابتدا آن را با یک صفحه نمایش STATIC امتحان کنیم. در حالی که به صلیب، زیر، بدون حرکت چشمان خود نگاه می کنید: چه حرفی است؟\n\n             +               R  \n\nاین یک R است. این صفحه نمایش ثابت است، بنابراین به راحتی می توان چشمان خود را به سمت حرف حرکت داد و آن را شناسایی کرد. اما، در یک آزمایش واقعی، نامه فلش شده است، بنابراین زمانی برای حرکت دادن چشمان شما وجود ندارد. لطفاً هنگام شروع محاکمه به صلیب نگاه کنید. مهم نیست چشمان شما بعد از فلاش به کجا می رود. اولین بلوک آزمایش فقط چند آزمایش تمرین است، قبل از اینکه به طور جدی شروع کنیم.",
