    sv: "Loading...",
    tl: "Sa bawat pagsubok, habang tumitingin ka sa krus, isang random na digit ang mag-FLASH sa sulok ng iyong mata. Isang flash lang. Upang matutunan ang gawain, subukan muna natin ito gamit ang isang STATIC na display. Habang nakatingin sa krus, sa ibaba, nang hindi ginagalaw ang iyong mga mata: Anong digit ito?\n\n             +               3  \n\nIto ay 3. Ang display na ito ay static, kaya magiging madaling ilipat ang iyong mga mata sa digit at tukuyin ito. Ngunit, sa isang tunay na pagsubok, ang digit ay FLASHED, kaya walang oras upang ilipat ang iyong mga mata. Mangyaring tingnan ang krus habang sinisimulan mo ang paglilitis. Hindi mahalaga kung saan pupunta ang iyong mga mata pagkatapos ng flash. Ang unang bloke ng pagsubok ay ilan lamang sa mga pagsubok ng pagsasanay, bago tayo magsimula nang masigasig.",
    tr: "Her denemede, çarpıya bakarken, gözünüzün köşesinde rastgele bir rakam YANIP SÖNECEK. Sadece bir şimşek. Görevi öğrenmek için önce STATİK bir gösterimle deneyelim. Aşağıda, gözlerinizi hareket ettirmeden çarpıya bakarken: Hangi rakam?\n\n              +                3  \n\n3. Bu gösterim statiktir, bu nedenle gözlerinizi rakama götürmeniz ve onu tanımlamanız kolay olacaktır. Ancak gerçek bir denemede, rakam YANIP SÖNÜYOR, bu nedenle gözlerinizi hareket ettirmek için zamanınız yok. Lütfen denemeyi başlatırken çarpıya bakın. Flaştan sonra gözlerinizin nereye gittiği önemli değil. İlk test bloğu, ciddi olarak başlamadan önce sadece birkaç pratik denemedir.",
